REPLACE INTO `items` (`id`, `name`, `description`, `plaintext`) VALUES
	(1001, '속도의 장화', '<groupLimit>1개만 구입 가능합니다.</groupLimit><br><br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +25', '이동 속도가 약간 증가합니다.'),
	(1004, '요정의 부적', '<stats><mana>기본 마나 재생 +25% </mana></stats>', '마나 재생량이 약간 증가합니다.'),
	(1006, '원기 회복의 구슬', '<stats>기본 체력 재생 +50% </stats>', '체력 재생량이 약간 증가합니다.'),
	(1011, '거인의 허리띠', '<stats>체력 +380</stats>', '체력이 대폭 증가합니다.'),
	(1018, '민첩성의 망토', '<stats>치명타 확률 +20%</stats>', '치명타 확률이 증가합니다.'),
	(1026, '방출의 마법봉', '<stats>주문력 +40</stats>', '주문력이 상당히 상승합니다.'),
	(1027, '사파이어 수정', '<stats><mana>마나 +250</mana></stats>', '마나가 증가합니다.'),
	(1028, '루비 수정', '<stats>체력 +150</stats>', '체력이 증가합니다.'),
	(1029, '천 갑옷', '<stats>방어력 +15</stats>', '방어력이 약간 증가합니다.'),
	(1031, '쇠사슬 조끼', '<stats>방어력 +40</stats>', '방어력이 대폭 증가합니다.'),
	(1033, '마법무효화의 망토', '<stats>마법 저항력 +25</stats>', '마법 저항력이 약간 증가합니다.'),
	(1036, '롱소드', '<stats>공격력 +10</stats>', '공격력이 약간 증가합니다.'),
	(1037, '곡괭이', '<stats>공격력 +25</stats>', '공격력이 상당히 증가합니다.'),
	(1038, 'B.F. 대검', '<stats>공격력 +40</stats>', '공격력이 대폭 증가합니다.'),
	(1039, '사냥꾼의 부적', '<stats><mana>정글에서 기본 마나 재생 +150% </mana></stats><br><br><unique>고유 지속 효과 - 이빨:</unique> 몬스터에게 스킬 혹은 공격으로 피해를 입히면 5초 동안 25의 체력을 흡수합니다. 몬스터 처치 시 <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>특별 추가 경험치</a></font>를 얻습니다.', '정글에서 마나 재생을 돕고 몬스터에게 피해를 입힙니다.'),
	(1041, '사냥꾼의 마체테', '<stats>몬스터 대상 생명력 흡수 +8%</stats><br><br><unique>고유 지속 효과 - 손톱:</unique> 몬스터에게 기본 공격 적중 시 추가로 20의 피해를 입힙니다. 몬스터 처치 시 <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>특별 추가 경험치</a></font>를 얻습니다.', '몬스터 상대 공격력이 상승하고 생명력을 흡수합니다.'),
	(1042, '단검', '<stats>공격 속도 +12%</stats>', '공격 속도가 약간 증가합니다.'),
	(1043, '곡궁', '<stats>공격 속도 +25%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 추가 15의 물리 피해를 입힙니다.', '공격 속도가 대폭 증가합니다.'),
	(1051, '싸움꾼의 장갑', '<stats>치명타 확률 +10%</stats>', '치명타 확률이 약간 증가합니다.'),
	(1052, '증폭의 고서', '<stats>주문력 +20</stats>', '주문력이 약간 상승합니다.'),
	(1053, '흡혈의 낫', '<stats>공격력 +15<br>생명력 흡수 +10%</stats>', '기본 공격 시 체력을 회복합니다.'),
	(1054, '도란의 방패', '<stats>체력 +80</stats><br><br><passive>기본 지속 효과:</passive> 5초마다 6의 체력을 회복합니다.<br><unique>고유 지속 효과:</unique> 적 챔피언의 단일 대상 공격과 스킬 공격 피해량을 8만큼 막아줍니다.', '방어에 특화된 시작 아이템입니다.'),
	(1055, '도란의 검', '<stats>공격력 +8<br>체력 +80<br>생명력 흡수 +3%</stats>', '공격에 특화된 시작 아이템입니다.'),
	(1056, '도란의 반지', '<stats>체력 +60<br>주문력 +15<br><mana>기본 마나 재생 +50% </mana></stats><br><br><mana><passive>기본 지속 효과:</passive> 유닛 처치 시마다 4의 마나를 회복합니다.</mana>', '스킬 사용에 특화된 시작 아이템입니다.'),
	(1057, '음전자 망토', '<stats>마법 저항력 +40</stats>', '마법 저항력이 상당히 증가합니다.'),
	(1058, '쓸데없이 큰 지팡이', '<stats>주문력 +60</stats>', '주문력이 대폭 상승합니다.'),
	(1082, '암흑의 인장', '<stats>주문력 +15<br>물약 회복량 증가 +25%<br><mana>마나 +100</mana></stats><br><br><unique>고유 지속 효과 - 두려움:</unique> 영광 중첩 하나 당 주문력이 3만큼 상승합니다. <br><unique>고유 지속 효과 - 절체절명:</unique> 적 챔피언을 처치할 때마다 영광 중첩 2회, 어시스트를 올릴 때마다 영광 중첩 1회가 쌓이고 중첩은 최대 10회까지 쌓을 수 있습니다. 사망 시 중첩 4회가 사라집니다.', '주문력과 마나가 상승하며 적을 처치할 때마다 더욱 강력해집니다.'),
	(1083, '수확의 낫', '<stats>공격력 +7<br>적중 시 생명력 흡수 +3</stats><br><br><unique>고유 지속 효과:</unique> 공격로 미니언 처치 시 추가로 1 골드를 얻습니다. 공격로 미니언을 총 100회 처치하면 즉시 350의 추가 골드를 얻고 기본 지속 효과가 비활성화됩니다.', '피해를 입히고 적중 시 생명력을 흡수합니다. 미니언 처치 시 추가 골드를 얻습니다.'),
	(1400, '마법 부여: 용사', '<stats>공격력 +60<br>재사용 대기시간 감소 +10%</stats>', '공격력이 증가하고 재사용 대기시간이 감소합니다.'),
	(1401, '마법 부여: 잿불거인', '<stats>체력 +400<br>추가 체력 +15%</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 전투 중일 때 근처 적에게 초당 7 (챔피언 레벨당 +2)의 마법 피해를 입힙니다. 몬스터에게는 100%의 추가 피해를 입힙니다. ', '체력과 불사르기 오오라를 부여합니다.'),
	(1402, '마법 부여: 룬의 메아리', '<stats>주문력 +60<br>이동 속도 +7% </stats><br><br><unique>고유 지속 효과 - 메아리:</unique> 이동하거나 스킬을 사용하면 중첩이 쌓입니다. 중첩이 100회 쌓이면 다음에 스킬로 피해를 입혔을 때 중첩을 모두 소모하여 최대 4명의 대상에게 60 (+ 주문력의 10%)의 추가 마법 피해를 입힙니다.<br><br> 대형 몬스터에게는 250%의 피해를 입히며, 이 효과가 대형 몬스터에게 적중하면 잃은 마나의 18%를 회복합니다.', '주문력이 증가하고 주기적으로 스킬이 강화됩니다.'),
	(1408, '마법 부여: 용사', '<stats>공격력 +60<br>재사용 대기시간 감소 +10%</stats>', '공격력이 증가하고 재사용 대기시간이 감소합니다.'),
	(1409, '마법 부여: 잿불거인', '<stats>체력 +400<br>추가 체력 +15%</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 전투 중일 때 근처 적에게 초당 7 (챔피언 레벨당 +2)의 마법 피해를 입힙니다. 몬스터에게는 100%의 추가 피해를 입힙니다. ', '체력과 불사르기 오오라를 부여합니다.'),
