	(1413, '마법 부여: 잿불거인', '<stats>체력 +400<br>추가 체력 +15%</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 전투 중일 때 근처 적에게 초당 7 (챔피언 레벨당 +2)의 마법 피해를 입힙니다. 몬스터에게는 100%의 추가 피해를 입힙니다. ', '체력과 불사르기 오오라를 부여합니다.'),
	(1414, '마법 부여: 룬의 메아리', '<stats>주문력 +60<br>이동 속도 +7% </stats><br><br><unique>고유 지속 효과 - 메아리:</unique> 이동하거나 스킬을 사용하면 중첩이 쌓입니다. 중첩이 100회 쌓이면 다음에 스킬로 피해를 입혔을 때 중첩을 모두 소모하여 최대 4명의 대상에게 60 (+ 주문력의 10%)의 추가 마법 피해를 입힙니다.<br><br> 대형 몬스터에게는 250%의 피해를 입히며, 이 효과가 대형 몬스터에게 적중하면 잃은 마나의 18%를 회복합니다.', '주문력이 증가하고 주기적으로 스킬이 강화됩니다.'),
	(1416, '마법 부여: 피갈퀴손', '<stats>공격 속도 +50%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상 최대 체력의 4%만큼 추가 물리 피해를 입힙니다. (몬스터와 미니언 상대로 최대 75)', '공격 속도가 증가하고 대상의 체력에 비례한 피해를 입힙니다.'),
	(1418, '마법 부여: 피갈퀴손', '<stats>공격 속도 +50%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상 최대 체력의 4%만큼 추가 물리 피해를 입힙니다. (몬스터와 미니언 상대로 최대 75)', '공격 속도가 증가하고 대상의 체력에 비례한 피해를 입힙니다.'),
	(1419, '마법 부여: 피갈퀴손', '<stats>공격 속도 +50%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상 최대 체력의 4%만큼 추가 물리 피해를 입힙니다. (몬스터와 미니언 상대로 최대 75)', '공격 속도가 증가하고 대상의 체력에 비례한 피해를 입힙니다.'),
	(2003, '체력 물약', '<groupLimit>한 번에 한 종류의 회복 물약만 최대 5개까지 소지할 수 있습니다.</groupLimit><br><br><consumable>클릭하여 사용:</consumable> 15초에 걸쳐 150의 체력을 회복합니다.', '사용하면 일정 시간 동안 체력이 회복됩니다.'),
	(2009, '원기회복의 완전한 비스킷', '<consumable>클릭하여 사용:</consumable> 10초에 걸쳐 체력 80과 마나 50을 회복합니다.', NULL),
	(2010, '원기회복의 완전한 비스킷', '<consumable>클릭하여 사용:</consumable> 즉시 15의 체력과 15의 마나를 회복한 다음, 15초에 걸쳐 150의 체력이 회복됩니다.', NULL),
	(2015, '키르히아이스의 파편', '<stats>공격 속도 +15%</stats><br><br><passive>지속 효과:</passive> 이동 및 공격 시 <a href=\'Energized\'>충전 상태</a>로 한 번 공격할 수 있게 됩니다.<br><br><unique>고유 지속 효과 - 충전된 일격:</unique> 충전 상태로 공격하여 적중 시 40의 추가 마법 피해를 입힙니다.', '공격 속도가 늘어나고 충전식 마법 피해를 입힙니다.'),
	(2031, '충전형 물약', '<groupLimit>한 번에 한 종류의 회복 물약만 소지할 수 있습니다.</groupLimit><br><br><active>고유 사용 효과:</active> 충전량을 1회 소모해 12초 동안 125의 체력을 회복합니다. 상점 방문 시 2회의 충전량이 다시 채워집니다.', '일정 시간 동안 체력이 회복되며, 상점에 가면 다시 충전됩니다.'),
	(2032, '사냥꾼의 물약', '<groupLimit>한 번에 한 종류의 회복 물약만 소지할 수 있습니다.</groupLimit><br><br><active>고유 사용 효과:</active> 충전량을 1회 소모해 8초에 걸쳐 60의 체력과 35의 마나를 회복합니다. 상점 방문 시 5회의 충전량이 다시 채워집니다.<br><br>대형 몬스터 처치 시마다 1회의 충전량이 채워집니다.<br><br><rules>(충전량이 최대치에 도달한 상태로 대형 몬스터를 처치할 경우 새로 채워질 충전량은 자동으로 사용됩니다.)</rules>', '체력과 마나가 일정 시간 동안 회복됩니다. 상점에 가면 다시 충전되며 효율이 증가합니다.'),
	(2033, '부패 물약', '<groupLimit>한 번에 한 종류의 회복 물약만 소지할 수 있습니다.</groupLimit><br><br><active>고유 사용 효과:</active> 충전량을 1회 소모해 12초 동안 125의 체력과 75의 마나를 회복하고, 그 동안 <font color=\'#FF8811\'><u>부패의 손길</u></font>을 활성화합니다. 상점 방문 시 3회의 충전량이 다시 채워집니다.<br><br><font color=\'#FF8811\'><u>부패의 손길:</u></font> 적 챔피언에게 주문 및 공격으로 피해를 입히면 적을 불태워 3초 동안 <levelScale>15 - 30</levelScale>의 마법 피해를 입힙니다. (광역 및 지속 피해 스킬 사용 시에는 절반의 피해만 적용됩니다. 피해량은 챔피언 레벨에 비례해 증가합니다.)<br><br><rules>(부패 물약은 체력과 마나가 모두 차 있을 때도 사용할 수 있습니다.)</rules>', '체력과 마나가 일정 시간 동안 회복되고 전투 능력을 상승시킵니다. 상점에 가면 다시 충전됩니다.'),
	(2043, '투명 감지 와드', '<groupLimit>투명 감지 와드는 가방에 2개만 소지할 수 있습니다.</groupLimit><br><br><consumable>클릭하여 사용:</consumable> 파괴될 때까지 주변 지역과 은신한 유닛을 드러내 주는 불투명한 와드를 설치합니다. 플레이어 당 맵에 설치할 수 있는 <font color=\'#BBFFFF\'>투명 감지 와드</font>의 갯수 한도는 1개로 제한됩니다.<br><br><rules>(이 와드로 드러낸 유닛을 처치할 경우, 설치한 플레이어에게 골드 보상의 일부가 주어집니다.)</rules>', '사용하면 파괴되기 전까지 해당 지역의 투명한 유닛을 볼 수 있으며 시야가 확보됩니다.'),
	(2045, '루비 시야석', '<stats>체력 +500</stats><br><br><unique>고유 지속 효과:</unique> 사용 효과가 있는 아이템의 재사용 대기시간이 20% 줄어듭니다.<br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초 동안 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 4회의 충전량이 다시 채워집니다.<br><br><rules>(플레이어 당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있으며, 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '체력이 대폭 늘어나고 계속해서 투명 와드를 얻을 수 있습니다.'),
	(2047, '예언자의 추출액', '<consumable>클릭하여 사용:</consumable> 5분 동안 주위의 투명하거나 보이지 않는 유닛을 감지하는 능력이 생깁니다.', '챔피언이 투명하거나 보이지 않는 적 유닛을 볼 수 있게 됩니다.'),
	(2049, '시야석', '<stats>체력 +150</stats><br><br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초 동안 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 3회의 충전량이 다시 채워집니다.<br><br><rules>(플레이어 당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있으며, 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '체력이 늘어나고 계속해서 투명 와드를 얻을 수 있습니다.'),
	(2050, '탐험가의 와드', '<consumable>클릭하여 사용:</consumable> 주변 지역을 60초 동안 드러내주는 투명한 와드를 설치합니다.', NULL),
	(2051, '수호자의 뿔피리', '<stats>체력 +150</stats><br><br><passive>기본 지속 효과:</passive> 5초마다 20의 체력을 회복합니다.<br><unique>고유 지속 효과:</unique> 적 챔피언의 기본 공격과 스킬 공격 피해량을 12만큼 막아줍니다. (지속 피해 스킬의 경우 25%의 효과).<br><br><groupLimit>수호자 아이템은 1개만 소유할 수 있습니다.</groupLimit>', '탱커에게 특화된 시작 아이템입니다.'),
	(2052, '포로 간식', '방목해서 신선한 풀을 먹여 키운 아바로사 암탉과 화학 비료를 쓰지 않고 재배한 프렐요드산 유기농 허브로 맛있게 조리한 영양 만점 요리. 포로에게 먹이면 신나서 갸르릉거립니다.<br><br><i>수익금은 전액 녹서스 동물 학대 반대 운동 기금으로 기부됩니다.</i>', NULL),
	(2053, '칼날부리의 망토', '<stats>방어력 +40<br>기본 체력 재생 +125% </stats><br><br><unique>고유 지속 효과 - 단거리 주자:</unique> 포탑이나 무너진 포탑, 공허의 문 근처에서는 2초에 걸쳐 이동 속도가 최대 +20%까지 상승합니다.', '포탑 근처에서 이동 속도가 상승합니다.'),
	(2054, '다이어트 포로 간식', '맛은 그대로, 칼로리는 절반! 몸매에도 건강에도 좋은 신제품입니다.<br><br><consumable>클릭해서 사용:</consumable> 포로에게 맛있고 건강한 새 간식을 먹이세요.', NULL),
	(2138, '강철의 영약', '<stats><levelLimit>9레벨 이상 구매 가능</levelLimit></stats><br><br><consumable>클릭하여 사용:</consumable> 3분 동안 체력이 +300, 강인함이 25% 증가하고, 챔피언이 거대해지며, <font color=\'#FF8811\'><u>강철의 길</u></font> 효과가 생깁니다.<br><br><font color=\'#FF8811\'><u>강철의 길:</u></font> 이동하면 뒤로 길이 생겨 그 위의 아군 챔피언들은 이동 속도가 15% 상승합니다.<br><br><rules>(영약 효과는 한 번에 하나만 활성화됩니다.)</rules>', '일시적으로 방어 관련 능력치를 높여줍니다. 아군이 뒤따라올 수 있는 자취를 남깁니다.'),
	(2139, '마법의 영약', '<stats><levelLimit>9레벨 이상 구매 가능</levelLimit></stats><br><br><consumable>클릭하여 사용:</consumable> 3분 동안 주문력 +50, 5초당 마나 재생량이 +15 오르며 <font color=\'#FF8811\'><u>마법</u></font> 효과가 생깁니다. <br><br><font color=\'#FF8811\'><u>마법:</u></font> 챔피언이나 포탑에 피해를 입히면 25의 추가 고정 피해를 입힙니다. 이 효과는 챔피언 상대로는 5초의 재사용 대기시간이 적용되지만, 포탑을 공격할 때는 재사용 대기시간이 없습니다.<br><br><rules>(영약 효과는 한 번에 하나만 활성화됩니다.)</rules><br>', '일시적으로 주문력을 올려주며, 챔피언과 포탑에 대한 추가 피해량이 적용됩니다.'),
	(2140, '분노의 영약', '<stats><levelLimit>9레벨 이상 구매 가능</levelLimit></stats><br><br><consumable>클릭하여 사용:</consumable> 3분 동안 공격력이 +30 상승하고 <font color=\'#FF8811\'><u>피의 갈망</u></font> 효과가 생깁니다.<br><br><font color=\'#FF8811\'><u>피의 갈망:</u></font> 챔피언에게 물리 피해를 입히면, 입힌 피해량의 15%만큼 체력이 회복됩니다.<br><br><rules>(영약 효과는 한 번에 하나만 활성화됩니다.)</rules>', '일시적으로 공격력을 올려주며, 챔피언에게 물리 피해를 입히면 체력이 회복됩니다.'),
	(2301, '수호자의 눈', '<stats>체력 +200<br><mana>기본 마나 재생 +100% </mana><br>주문력 +25<br>재사용 대기시간 감소 +10%<br>10초당 골드 +2</stats><br><br><unique>고유 지속 효과 - 헌납:</unique> 챔피언과 구조물에 대한 스킬과 기본 공격 시 15의 추가 피해를 입히고 15골드를 획득합니다. 30초당 최대 3번까지만 발동합니다.<br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초 동안 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 4회의 충전량이 다시 채워집니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><rules>(플레이어 당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있으며, 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '주문력이 증가하며 투명 와드를 지속적으로 공급합니다.'),
	(2302, '오아시스의 눈', '<stats>체력 +200<br>기본 체력 재생 +150% <br><mana>기본 마나 재생 +100% </mana><br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과 - 나눠받기:</unique> 주변에서 내가 최후의 일격을 가하지 않은 미니언이 쓰러지면 6골드와 체력 10을 얻습니다.<br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초 동안 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 4회의 충전량이 다시 채워집니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><rules>(플레이어 당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있으며, 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '체력 재생이 증가하며 투명 와드를 지속적으로 공급합니다.'),
	(2303, '태양의 눈', '<stats>체력 +500<br>기본 체력 재생 +100% <br>10초당 골드 +2</stats><br><br><unique>고유 지속 효과 - 전리품:</unique> 근접 기본 공격 시 체력이 320 (레벨 당 +20) 이하인 미니언이 처치됩니다. 미니언을 처치하면 자신과 더불어 가장 가까이 있는 아군 챔피언의 체력을 50씩 치유하며, 둘에게 처치한 골드가 부여됩니다. 이 효과는 근처에 아군이 있어야 하며, 30초마다 재충전됩니다. (최대 충전량 4번)<br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초 동안 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 4회의 충전량이 다시 채워집니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><rules>(플레이어 하나당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있으며, 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '체력이 증가하며 투명 와드를 지속적으로 공급합니다.'),
	(3001, '심연의 홀', '<stats>주문력 +60<br>마법 저항력 +60<br>재사용 대기시간 감소 +10%</stats><br><br><aura>고유 오오라:</aura> 주변 적 챔피언의 마법 저항력을 <levelScale>10 - 25</levelScale> 감소시킵니다.', '주변 적의 마법 저항력이 감소합니다.'),
	(3003, '대천사의 지팡이', '<stats>주문력 +80<br><mana>마나 +250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 3%만큼 주문력이 오릅니다. 마나를 사용하면 소모량의 25%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 스킬을 사용하거나 마나를 소모할 때마다 최대 마나가 +8 증가합니다. (최대 마나 +750) (매 8초당 최대 2번 발동)<br><br>마나 +750에 도달하면 대천사의 포옹으로 변합니다.</mana>', '최대 마나량에 따라 주문력이 대폭 상승합니다.'),
	(3004, '마나무네', '<stats>공격력 +25<br><mana>마나 +250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 2%만큼 추가 공격력을 얻습니다. 마나를 사용하면 소모량의 15%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 기본 공격, 스킬 사용, 마나 소모 시 최대 마나가 +4 증가합니다. (최대 마나 +750) (매 8초당 최대 2번 발동)<br><br>마나 +750에 도달하면 무라마나로 변합니다.</mana>', '최대 마나량에 따라 공격력이 상승합니다.'),
	(3006, '광전사의 군화', '<stats>공격 속도 +35%</stats><br><br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +45', '이동 속도와 공격 속도가 상승합니다.'),
	(3007, '대천사의 지팡이 (급속 충전)', '<stats>주문력 +80<br><mana>마나 +250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 3%만큼 주문력이 오릅니다. 마나를 사용하면 소모량의 25%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 스킬을 사용하거나 마나를 소모할 때마다 최대 마나가 +12 증가합니다. (최대 마나 +750) (매 8초당 최대 2번 발동)<br><br>마나 +750에 도달하면 대천사의 포옹으로 변합니다.</mana>', '최대 마나량에 따라 주문력이 대폭 상승합니다.'),
	(3008, '마나무네 (급속 충전)', '<stats>공격력 +25<br><mana>마나 +250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 2%만큼 추가 공격력을 얻습니다. 마나를 사용하면 소모량의 15%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 기본 공격, 스킬 사용, 마나 소모 시 최대 마나가 +6 증가합니다. (최대 마나 +750) (매 8초당 최대 2번 발동)<br><br>마나 +750에 도달하면 무라마나로 변합니다.</mana>', '최대 마나량에 따라 공격력이 상승합니다.'),
	(3009, '신속의 장화', '<unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +55<br><unique>고유 지속 효과 - 둔화 저항:</unique> 이동 속도 둔화 효과가 25% 줄어듭니다.', '이동 속도가 증가하고, 둔화 효과를 감소시킵니다.'),
	(3010, '억겁의 카탈리스트', '<stats>체력 +225<br><mana>마나 +300</mana></stats><br><br><unique>고유 지속 효과 - 영원:</unique> 챔피언으로부터 입은 피해의 15%를 마나로 돌려받습니다.<br><br>마나 소모 시 20%를 체력으로 돌려받습니다. (스킬 사용 1회당 최대 15까지)<br><br><rules>활성화 (토글) 스킬의 경우 초당 최대 15의 체력이 회복됩니다.</rules>', '마나를 소모해 체력을 회복합니다.'),
	(3020, '마법사의 신발', '<stats><a href=\'FlatMagicPen\'>마법 관통력</a> +15</stats><br><br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +45', '이동 속도와 마법 피해량이 증가합니다.'),
	(3022, '얼어붙은 망치', '<stats>체력 +700<br>공격력 +30</stats><br><br><unique>고유 지속 효과 - 얼음:</unique> 기본 공격 적중 시 대상의 이동 속도가 1.5초 동안 감소합니다. (근접 공격 시 40%, 원거리 공격 시 30%)', '기본 공격으로 피해를 입힌 적이 둔화됩니다.'),
	(3024, '빙하의 장막', '<stats>방어력 +25<br><mana>마나 +250</mana></stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%', '방어력과 재사용 대기시간 감소율이 증가합니다.'),
	(3025, '얼어붙은 건틀릿', '<stats>방어력 +65<br>재사용 대기시간 감소 +20%<br><mana>마나 +500</mana></stats><br><br><unique>고유 지속 효과 - 주문 검:</unique> 스킬을 사용하고 나면 다음 기본 공격 적중 시 대상 근처의 적들에게 기본 공격력의 100%만큼 추가 물리 피해를 입히고 2초간 역장을 생성하여, 안에 갇힌 적의 속도를 30% 늦춥니다. (재사용 대기시간 1.5초)<br><br>역장의 크기는 추가 방어력에 비례해 커집니다.', '스킬을 시전한 후 기본 공격을 하면 둔화 역장이 생성됩니다.'),
	(3026, '수호 천사', '<stats>방어력 +60<br>마법 저항력 +45</stats><br><br><unique>고유 지속 효과:</unique> 치명적인 피해를 입으면 4초 동안 경직에 걸린 뒤 최대 체력의 30% 또는 700 중 더 큰 양의 체력을 회복하고 최대 마나의 30%를 회복합니다. (재사용 대기시간 300초)', '주기적으로 챔피언 사망 시 부활시켜 줍니다.'),
	(3027, '영겁의 지팡이', '<stats>체력 +300<br><mana>마나 +300</mana><br>주문력 +60</stats><br><br><passive>기본 지속 효과:</passive> 매 중첩 당 체력 +20, 마나 +10, 주문력 +4의 능력치를 올려줍니다. (최대 체력 +200, 마나 +100, 주문력 +40) 매 분 당 중첩이 1 오릅니다. (최대 중첩 수 10)<br><unique>고유 지속 효과 - 영원:</unique> 챔피언으로부터 입은 피해의 15%를 마나로 돌려받습니다. 마나 소모 시 20%를 체력으로 돌려받습니다. (스킬 사용 1회당 최대 25까지)', '체력, 마나, 주문력이 크게 증가합니다.'),
	(3028, '조화의 성배', '<stats>마법 저항력 +25<br><mana>기본 마나 재생 +50% </mana></stats><br><br><unique>고유 지속 효과: </unique>현재 체력 %가 마나 %보다 낮으면 기본 체력 재생이 100% 증가합니다.<br><br>현재 마나 %가 체력 %보다 낮으면 기본 마나 재생이 100% 증가합니다.', '마나 및 체력 재생이 증가합니다.'),
	(3029, '영겁의 지팡이 (급속 충전)', '<stats>체력 +300<br><mana>마나 +300</mana><br>주문력 +60</stats><br><br><passive>기본 지속 효과:</passive> 매 중첩 당 체력 +20, 마나 +10, 주문력 +4의 능력치를 올려줍니다. (최대 체력 +200, 마나 +100, 주문력 +40) 매 40초 당 중첩이 1 오릅니다. (최대 중첩 수 10)<br><unique>고유 지속 효과 - 영원:</unique> 챔피언으로부터 입은 피해의 15%를 마나로 돌려받습니다. 마나 소모 시 20%를 체력으로 돌려받습니다. (스킬 사용 1회당 최대 25까지)', '체력, 마나, 주문력이 크게 증가합니다.'),
	(3030, '마법공학 GLP-800', '<stats>체력 +300<br><mana>마나 +400</mana><br>주문력 +80</stats><br><br><unique>고유 지속 효과 - 영원:</unique> 챔피언으로부터 입은 피해의 15%를 마���로 돌려받습니다. 마나 소모 시 20%를 체력으로 돌려받습니다. (스킬 사용 1회당 최대 25까지)<br><unique>고유 사용 효과 - 서리 탄환:</unique> 얼어붙은 탄환을 무더기로 발사해 적 챔피언에게 <levelScale>100 - 200</levelScale> (+ 주문력의 35%)의 마법 피해를 입힙니다. (재사용 대기시간은 40초이며 다른 <font color=\'#9999FF\'><a href=\'itembolt\'>마법공학</a></font> 아이템과 재사용 대기시간을 공유합니다.)<br><br>적중당한 적은 65% 둔화되며 둔화 효과는 0.5초에 걸쳐 사라집니다.<br><br><rules>(서리 탄환에는 시전 시간이 있습니다.)</rules> ', '사용하면 얼어붙은 탄환을 발사해 적을 둔화시킵니다.'),
	(3031, '무한의 대검', '<stats>공격력 +70<br>치명타 확률 +20%</stats><br><br><unique>고유 지속 효과:</unique> 치명타 추가 피해량이 50% 증가합니다.', '치명타 확률이 대폭 증가합니다.'),
	(3033, '필멸자의 운명', '<stats>공격력 +50</stats><br><br><unique>고유 지속 효과 - 처형인:</unique> 물리 피해를 가하면 적 챔피언에게 5초 동안 <a href=\'GrievousWounds\'>고통스러운 상처</a>를 남깁니다.<br><unique>고유 지속 효과 - 최후의 속삭임:</unique> <a href=\'BonusArmorPen\'>추가 방어구 관통력</a> +45%', '체력 회복력과 방어력이 뛰어난 적에게 효과적입니다.'),
	(3034, '거인 학살자', '<stats>공격력 +10</stats><br><br><unique>고유 지속 효과 - 거인 학살자:</unique> 자신보다 최대 체력이 높은 적에게 최대 +10%의 추가 물리 피해를 입힙니다. (체력 차이 50마다 피해량 +1%. 체력 차이는 최대 500까지만 계산됩니다.)<br><br><rules>(같은 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '체력이 뛰어난 적에게 효과적입니다.'),
	(3035, '최후의 속삭임', '<stats>공격력 +25</stats><br><br><unique>고유 지속 효과 - 최후의 속삭임:</unique> <a href=\'BonusArmorPen\'>추가 방어구 관통력</a> +30%', '방어력이 뛰어난 적에게 효과적입니다.'),
	(3036, '도미닉 경의 인사', '<stats>공격력 +50</stats><br><br><unique>고유 지속 효과 - 거인 학살자:</unique> 자신보다 최대 체력이 높은 적에��� 최대 15%의 추가 물리 피해를 입힙니다. (체력 차이 50마다 피해량 +1.5%. 체력 차이는 최대 500까지만 계산됩니다.)<br><unique>고유 지속 효과 - 최후의 속삭임:</unique> <a href=\'BonusArmorPen\'>추가 방어구 관통력</a> +45%', '체력과 방어력이 뛰어난 적에게 효과적입니다.'),
	(3040, '대천사의 포옹', '<stats>주문력 +80<br><mana>마나 +1000</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 3%만큼 주문력이 오릅니다. 마나를 소모하면 소모량의 25%를 돌려받습니다.</mana><br><active>고유 사용 효과 - 마나 보호막:</active> 현재 마나의 20%를 소모하여 3초 동안 150 + 마나 소모량에 해당하는 피해를 흡수하는 보호막을 씌웁니다. (재사용 대기시간 120초)', NULL),
	(3041, '메자이의 영혼약탈자', '<stats>주문력 +20<br><mana>마나 +200</mana></stats><br><br><unique>고유 지속 효과 - 두려움:</unique> 영광 중첩 하나 당 주문력이 +5만큼 상승합니다. 15 중첩 이상일 때 이동 속도가 10% 상승합니다.<br><unique>고유 지속 효과 - 절체절명:</unique> 적 챔피언을 처치할 때마다 영광 중첩 4회, 어시스트를 올릴 때마다 영광 중첩 2회가 쌓이고 중첩은 최대 25회까지 쌓을 수 있습니다. 사망 시 중첩 10회가 사라집니다.', '챔피언을 처치하거나 어시스트를 올릴 경우, 주문력이 오릅니다.'),
	(3042, '무라마나', '<stats>공격력 +25<br><mana>마나 +1000</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 2%만큼 공격력이 오릅니다. 마나를 사용하면 15%를 돌려받습니다.</mana><br><mana><unique>고유 지속 효과 - 충격:</unique> 단일 대상에 대한 스킬 혹은 기본 공격이 <font color=\'#FFFFFF\'>챔피언</font>에게 적중 시 현재 마나의 3%를 소모하여, 소모한 마나의 두 배만큼 추가 물리 피해를 입힙니다.<br><br>이 효과는 마나가 최대치의 20% 이상 남아 있을 때만 활성화됩니다.</mana>', NULL),
	(3043, '무라마나', '<stats>공격력 +25<br><mana>마나 +1000</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 2%만큼 공격력이 오릅니다. 마나를 사용하면 15%를 돌려받습니다.</mana><br><mana><unique>고유 지속 효과 - 충격:</unique> 단일 대상에 대한 스킬 혹은 기본 공격이 <font color=\'#FFFFFF\'>챔피언</font>에게 적중 시 현재 마나의 3%를 소모하여, 소모한 마나의 두 배만큼 추가 물리 피해를 입힙니다.<br><br>이 효과는 마나가 최대치의 20% 이상 남아 있을 때만 활성화됩니다.</mana>', NULL),
	(3044, '탐식의 망치', '<stats>체력 +200<br>공격력 +15</stats><br><br><unique>고유 지속 효과 - 격분:</unique> 기본 공격 시 2초간 이동 속도가 20 상승합니다. 적을 처치하면 이동 속도가 60 상승합니다. 원거리 챔피언의 경우 이동 속도 상승 효과는 절반만 적용됩니다.', '적을 공격하거나 처치하면 이동 속도가 잠시 상승합니다.'),
	(3046, '유령 무희', '<stats>공격 속도 +45%<br>치명타 확률 +30%<br>이동 속도 +5%</stats><br><br><unique>고유 지속 효과 - 망령의 왈츠:</unique> 550 범위 내에 보이는 적 챔피언이 있을 경우 이동 속도가 7% 증가하고 유닛을 통과할 수 있습니다.<br><unique>고유 지속 효과 - 슬픔의 노래:</unique> 마지막으로 공격한 챔피언에게 받는 피해량이 12% 줄어듭니다. (10초 동안 공격하지 않으면 효과가 사라집니다.)', '적 근처에서 더 빠르게 움직이며 받는 피해량을 줄입니다.'),
	(3047, '닌자의 신발', '<stats>방어력 +30</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 피해량의 12%를 막아 줍니다.<br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +45', '이동 속도가 증가하고, 적에게 받는 기본 공격의 피해가 줄어듭니다.'),
	(3048, '대천사의 포옹', '<stats>주문력 +80<br><mana>마나 +1000</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 최대 마나의 3%만큼 주문력이 오릅니다. 마나를 소모하면 소모량의 25%를 돌려받습니다.</mana><br><active>고유 사용 효과 - 마나 보호막:</active> 현재 마나의 20%를 소모하여 3초 동안 150 + 마나 소모량에 해당하는 피해를 흡수하는 보호막을 씌웁니다. (재사용 대기시간 120초)', NULL),
	(3050, '지크의 선지자', '<stats><mana>마나 +250</mana><br>방어력 +30<br>주문력 +50<br>재사용 대기시간 감소 +10%</stats><br><br><active>고유 사용 효과 - 전도체:</active> 대상 아군과 결속됩니다. (재사용 대기시간 60초)<br><unique>고유 지속 효과:</unique> 아군과 자신이 서로 1000 유닛 거리 안에 있을 때는 둘 다 중첩이 쌓입니다. 기본 공격이나 스킬 공격으로 추가 중첩이 생깁니다. 100 중첩이 되면 중첩을 모두 소모하여 피해를 가하며, 8초간 자신과 아군의 주문력이 20%, 치명타 확률이 50% 상승합니다. ', '아군 한 명의 치명타율과 주문력을 대폭 증가시킵니다.'),
	(3052, '요림의 주먹', '<stats>공격력 +15<br>체력 +150</stats><br><br><unique>고유 지속 효과:</unique> 유닛을 처치하면 최대 체력이 5 오릅니다. 이 효과는 최대 30번까지 중첩됩니다.', '공격력을 올려주며 유닛 처치 시 체력이 중첩됩니다.'),
	(3053, '스테락의 도전', '<stats>체력 +400<br>기본 공격력 +25% </stats><br><br><unique>고유 지속 효과 - 생명선:</unique> 5초 안에 400 ~ 1800 이상의 피해를 (레벨에 비례) 입으면 8초 동안 최대 체력의 30%에 해당하는 보호막이 생겼다가 빠르게 사라집니다. (재사용 대기시간 60초)<br><br><unlockedPassive>스테락의 분노:</unlockedPassive> <i>생명선</i> 효과가 발동되면 몸집과 힘이 커지고, 기본 공격력이 +25% 증가합니다.', '대량의 피해를 보호막으로 막아줍니다.'),
	(3056, '저항 공성기', '<stats>체력 +300<br>방어력 +50<br>기본 체력 재생 +150% <br>재사용 대기시간 감소 +10%</stats><br><br><active>고유 사용 효과:</active> 근처의 적 포탑이 3초 동안 공격할 수 없게 막습니다. (재사용 대기시간 120초) 이 효과는 동일한 포탑에 대해서는 8초가 지나야만 다시 적용됩니다.<br><br><unique>고유 지속 효과 - 단거리 주자:</unique> 포탑 및 공허 차원문 근처에서는 2초에 걸쳐 이동 속도가 최대 +20%까지 상승합니다. (무너진 포탑 포함)', '일시적으로 적 포탑을 비활성화합니다.'),
	(3057, '광휘의 검', '<stats><mana>마나 +250</mana><br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과 - 주문 검:</unique> 스킬을 사용하고 나면 다음 기본 공격 적중 시 기본 공격력의 100%에 해당하는 추가 물리 피해를 입힙니다. (재사용 대기시간 1.5초)', '스킬 공격 다음 공격에 추가 피해가 적용됩니다.'),
	(3060, '지휘관의 깃발', '<stats>체력 +200<br>기본 체력 재생 +100% <br>주문력 +60<br>마법 저항력 +20<br>재사용 대기시간 감소 +10%</stats><br><br><aura>고유 오오라 - 군단:</aura> 근처 아군의 마법 저항력이 +15 상승합니다.<br><active>고유 사용 효과 - 진급:</active> 공격로 미니언의 위력이 대폭 강해지며, 마법 피해에 대해 면역이 생깁니다. (재사용 대기시간 120초)', '공성 미니언을 더욱 강력한 유닛으로 진급시킵니다.'),
	(3065, '정령의 형상', '<stats>체력 +500<br>마법 저항력 +55<br>기본 체력 재생 +200% <br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과:</unique> 받는 모든 치유 효과가 25% 증가합니다.', '체력이 오르며 치유 효과가 커집니다.'),
	(3067, '점화석', '<stats>체력 +200  </stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%', '체력과 재사용 대기시간 감소량이 증가합니다.'),
	(3068, '태양불꽃 망토', '<stats>체력 +500<br>방어력 +50</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 근처 적에게 초당 25 (챔피언 레벨당 +1)의 마법 피해를 입힙니다. 미니언과 몬스터에게는 50%의 추가 피해를 입힙니다.', '주변 적에게 지속적으로 피해를 입힙니다.'),
	(3069, '승천의 부적', '<stats>방어력 +45<br>기본 체력 재생 +150% <br><mana>기본 마나 재생 +75% <br></mana>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과 - 단거리 주자:</unique> 포탑이나 무너진 포탑, 공허의 문 근처에서 2초에 걸쳐 이동 속도가 최대 +20%까지 상승합니다.<br><unique>고유 지속 효과 - 나눠받기:</unique> 주변에서 내가 최후의 일격을 가하지 않은 미니언이 쓰러지면 6골드와 체력 10을 얻습니다.<br><active>고유 사용 효과:</active> 3초 동안 주변 아군들의 이동 속도가 +40% 상승합니다. (재사용 대기시간 60초)<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><rules><font color=\'#447777\'>\'\'태양을 찬양하라.\'\' - 역사가 슈렐리아, CLE 25년 9월 22일</font></rules>', '체력과 재사용 대기시간 감소량을 올려줍니다. 사용하면 주변 아군의 속도가 빨라집니다.'),
	(3070, '여신의 눈물', '<stats>마나 <mana>+250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 마나를 사용하면 15%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 스킬을 시전하거나 마나를 소모할 때마다 최대 마나량이 4 증가합니다. (8초당 최대 2번 발동).<br><br>최대 마나 +750</mana>', '마나를 소모하면 최대 마나량이 증가합니다.'),
	(3071, '칠흑의 양날 도끼', '<stats>체력 +300<br>공격력 +50<br>재사용 대기시간 감소 +20%</stats><br><br><unique>고유 지속 효과:</unique> 적 챔피언에게 물리 피해를 입히면 대상을 베어, 6초 동안 방어력을 5% 감소시킵니다. (최대 6번, 30%까지 중첩)<br><unique>고유 지속 효과 - 격분:</unique> 물리 피해를 입히면 2초 동안 이동 속도가 20 상승합니다. 베어낸 적 챔피언의 처치를 돕거나 어떤 유닛이든 처치하면 대신 2초 동안 이동 속도가 60 상승합니다. 원거리 챔피언은 이 이동 속도의 절반만 상승합니다.', '적 챔피언에게 물리 피해를 입히면 적의 방어력이 감소합니다.'),
	(3072, '피바라기', '<stats>공격력 +75</stats><br><br><unique>고유 지속 효과:</unique> 생명력 흡수 +20%<br><unique>고유 지속 효과:</unique> 기본 공격을 통한 회복이 최대 체력 이상으로 가능합니다. 초과된 생명력은 보호막으로 전환되어 챔피언 레벨에 따라 50-350의 피해량을 막아줍니다.<br><br>이 보호막은 25초간 피해를 입히거나 받지 않으면 서서히 줄어듭니다.', '공격력 및 생명력 흡수가 증가하며, 생명력 흡수가 최대 체력 이상으로 가능해집니다.'),
	(3073, '여신의 눈물 (급속 충전)', '<stats>마나 <mana>+250</mana></stats><br><br><mana><unique>고유 지속 효과 - 경탄:</unique> 마나를 사용하면 15%를 돌려받습니다.<br><unique>고유 지속 효과 - 마나 충전:</unique> 스킬을 시전하거나 마나를 소모할 때마다 최대 마나량이 6 증가합니다. (8초당 최대 2번 발동).<br><br>최대 마나 +750</mana>', '마나를 소모하면 최대 마나량이 증가합니다.'),
	(3074, '굶주린 히드라', '<stats>공격력 +75<br>기본 체력 재생 +100% <br>생명력 흡수 +12%</stats><br><br><passive>기본 지속 효과:</passive> 이 아이템으로 가하는 피해에는 총 생명력 흡수의 50%가 적용됩니다.<br><unique>고유 지속 효과 - 베기:</unique> 공격하는 대상 주위의 유닛들은 기본 공격 적중 시 총 공격력의 20%에서 60%에 해당하는 추가 물리 피해를 입습니다. (공격하는 대상과 가장 가까운 적이 가장 큰 피해를 입습니다.)<br><active>고유 사용 효과 - 초승달:</active> 주위에 있는 적 유닛들은 총 공격력의 60%에서 100%에 해당하는 피해를 입습니다. (가장 가까운 적이 가장 큰 피해를 입습니다.) (재사용 대기시간 10초)', '근접 공격으로 주변의 적에게 피해를 주면 체력이 회복됩니다. '),
	(3075, '가시 갑옷', '<stats>방어력 +100</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격에 맞을 경우, 추가 방어력의 25% + 받는 피해량의 15%에 해당하는 마법 피해를 공격한 적에게 되돌려줍니다.<br><br><rules>(추가 방어력은 아이템, 이로운 효과, 룬, 특성으로 인한 방어력을 뜻합니다.)</rules><br><rules>(반사하는 피해량은 내 방어력으로 감소시키기 전에 받은 피해량을 기준으로 계산됩니다.)</rules>', '기본 공격으로 입은 피해를 마법 피해로 돌려줍니다.'),
	(3077, '티아맷', '<stats>공격력 +20<br>기본 체력 재생 +50% </stats><br><br><unique>고유 지속 효과 - 베기:</unique> 기본 공격 적중 시 대상 주위의 유닛들은 총 공격력의 20%에서 60%에 해당하는 추가 물리 피해를 입습니다. (공격 대상과 가장 가까운 적이 가장 큰 피해를 입습니다.)<br><active>고유 사용 효과 - 초승달:</active> 주위에 있는 적 유닛들에게 총 공격력의 60%에서 100%에 해당하는 물리 피해를 입힙니다. (가장 가까운 적이 가장 큰 피해를 입습니다.) (재사용 대기시간 10초)', '주변 적에게 근접 피해를 입힙니다.'),
	(3078, '삼위일체', '<stats>체력 +250<br><mana>마나 +250</mana><br>공격력 +25<br>공격 속도 +40%<br>재사용 대기시간 감소 +20%<br>이동 속도 +5%</stats><br><br><unique>고유 지속 효과 - 격분:</unique> 기본 공격 시 2초간 이동 속도가 20 상승합니다. 적을 처치하면 이동 속도가 60 상승합니다. 원거리 챔피언의 경우 이동 속도 상승 효과는 절반만 적용됩니다.<br><unique>고유 지속 효과 - 주문 검:</unique> 스킬을 사용하고 나면 다음 기본 공격 적중 시 기본 공격력의 200%에 해당하는 추가 물리 피해를 입힙니다. (재사용 대기시간 1.5초)', '취급주의: 이 아이템만 갖추면 \'엄청난 피해\'를 줄 수 있죠...'),
	(3082, '파수꾼의 갑옷', '<stats>방어력 +40</stats><br><br><unique>고유 지속 효과 - 차가운 강철:</unique> 기본 공격에 맞으면, 1초간 공격한 챔피언의 공격 속도가 15% 감소합니다.', '기본 공격에 적중당하면 공격한 적 챔피언의 공격 속도를 감소시킵니다.'),
	(3083, '워모그의 갑옷', '<stats>체력 +800<br>기본 체력 재생 +200% </stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%<br><unique>고유 지속 효과:</unique> 최대 체력이 최소 3000에 도달하면 <unlockedPassive>워모그의 심장</unlockedPassive> 효과가 부여됩니다.<br><br><unlockedPassive>워모그의 심장:</unlockedPassive> 8초 동안 피해를 입지 않으면 매 5초당 최대 체력의 15%가 회복됩니다.   ', '체력과 체력 재생량이 대폭 상승합니다.'),
	(3084, '지배자의 피갑옷', '<stats>체력 +800<br>기본 체력 재생 +100% </stats><br><br><unique>고유 지속 효과:</unique> 챔피언을 처치하거나 어시스트를 올리면 5초에 걸쳐 체력이 300 회복됩니다.', '적을 처치하거나 어시스트를 올리면 체력이 회복됩니다.'),
	(3085, '루난의 허리케인', '<stats>공격 속도 +40%<br>치명타 확률 +30%<br>이동 속도 +7%</stats><br><br><unique>고유 지속 효과 - 바람의 분노:</unique> 기본 공격 시 대상 주변 최대 2명의 적에게 작은 탄환을 발사하여, 각각 공격력의 25%에 해당하는 물리 피해를 입힙니다. 이 탄환에는 치명타 및 적중 시 효과가 적용됩니다.<br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 추가 15의 물리 피해를 입힙니다.', '원거리 공격 시 주변의 적들에게 두 발의 탄환을 발사합니다.'),
	(3086, '열정의 검', '<stats>공격 속도 +15%<br>치명타 확률 +20%</stats><br><br><unique>고유 지속 효과:</unique> 이동 속도 +5%', '치명타 확률, 이동 속도와 공격 속도가 약간 상승합니다.'),
	(3087, '스태틱의 단검', '<stats>공격 속도 +35%<br>치명타 확률 +30%<br>이동 속도 +5%</stats><br><br><passive>기본 지속 효과:</passive> 이동하거나 공격하면 <a href=\'Energized\'>충전 상태</a>가 됩니다.<br><br><unique>고유 지속 효과 - 쏟아지는 번개:</unique> 충전 상태 공격은 적중 시 최대 5명의 적에게 50에서 120의 추가 마법 피해(레벨에 비례)를 입힙니다. (미니언 상대로는 +120%의 추가 피해를 입히며, 치명타가 적용됩니다.)', '이동 시 점차 충전되어, 기본 공격 시 연쇄 번개를 발사합니다.'),
	(3089, '라바돈의 죽음모자', '<stats>주문력 +120  </stats><br><br><unique>고유 지속 효과:</unique> 주문력이 35% 상승합니다.', '주문력이 대폭 상승합니다.'),
	(3090, '우글렛의 마녀 모자', '<stats>주문력 +100<br>방어력 +45</stats><br><br><unique>고유 지속 효과:</unique> 주문력이 25% 증가합니다.<br><active>고유 사용 효과:</active> 챔피언이 2.5초 동안 아무런 행동도 취할 수 없는 대신 공격도 받지 않는 무적 상태가 됩니다. (재사용 대기시간 90초)', '주문력이 대폭 상승하고, 사용하면 챔피언이 경직 상태가 됩니다.'),
	(3091, '마법사의 최후', '<stats>공격 속도 +40%<br>마법 저항력 +40</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상에게 40의 추가 마법 피해를 입힙니다.<br><unique>고유 지속 효과:</unique> 기본 공격 적중 시마다 대상의 마법 저항력을 5만큼 훔칩니다. (최대 5번까지 중첩)', '기본 공격에 추가 마법 피해가 적용됩니다.'),
	(3092, '서리 여왕의 지배', '<stats>주문력 +50<br>재사용 대기시간 감소 +10%<br>10초당 골드 +2<br><mana>기본 마나 재생 +75% </mana></stats><br><br><unique>고유 지속 효과 - 헌납:</unique> 챔피언과 구조물에 대한 스킬과 기본 공격 시 15의 추가 피해를 입히고 15골드를 획득합니다. 매 30초당 최대 3회까지만 발동합니다.<br><active>고유 사용 효과:</active> 얼음 유령 2 마리를 6초 동안 소환해 주변의 적 챔피언을 찾게 합니다. 유령은 접촉한 적의 모습을 드러내고 유령이 이동한 거리에 따라 2 ~ 5초 동안 적의 이동 속도를 40% 감소시킵니다. (재사용 대기시간 90초)<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '망령을 불러내 숨어있는 적을 찾아내고 둔화시킵니다.'),
	(3094, '고속 연사포', '<stats>공격 속도 +30%<br>치명타 확률 +30%<br>이동 속도 +5%</stats><br><br><passive>기본 지속 효과:</passive> 이동하거나 공격하면 <a href=\'Energized\'>충전 상태</a>가 됩니다.<br><br><unique>고유 지속 효과 - 연사 개시:</unique> 충전 상태 공격은 사거리가 35% 증가하며 (최대 사거리 +150) 적중 시 50~160(레벨에 비례)의 추가 마법 피해를 입힙니다.<br><br>충전 상태 공격은 구조물에도 적용됩니다.', '이동하며 완전히 충전하면 강력한 일격을 발사합니다.'),
	(3096, '유목민의 메달', '<stats>기본 체력 재생 +25% <br><mana>기본 마나 재생+75% </mana><br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과 - 나눠받기:</unique> 주변에서 내가 최후의 일격을 가하지 않은 미니언이 쓰러지면 6골드와 10의 체력을 얻습니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><rules><font color=\'#447777\'>\'\'메달에 태양빛이 닿자 천 가지 목소리로 영광을 발한다.\'\' - 역사가 슈렐리아, CLE 24년 6월 22일</font></rules>', '주위에서 미니언이 쓰러지면 골드를 획득하며, 체력 재생과 마나 재생이 증가합니다.'),
	(3097, '타곤산의 보호', '<stats>체력 +175<br>기본 체력 재생 +50% <br>10초당 골드 획득 +2</stats><br><br><unique>고유 지속 효과 - 전리품:</unique> 근접 기본 공격 시 체력이 200 (레벨 당 +10) 이하인 미니언이 처치됩니다. 미니언을 처치하면 자신과 더불어 가장 가까이 있는 아군 챔피언의 체력이 40씩 회복되며, 둘에게 처치한 골드가 부여됩니다.<br><br>이 효과는 근처에 아군이 있어야 하며, 30초마다 재충전됩니다. 최대 충전량 3번<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '주기적으로 적 미니언을 처치하여 근처 아군을 치유하고 골드를 부여합니다.'),
	(3098, '얼음 송곳니', '<stats>주문력 +15<br>10초당 골드 +2<br><mana>기본 마나 재생 +75% </mana></stats><br><br><unique>고유 지속 효과 - 헌납:</unique> 챔피언과 구조물에 대한 스킬과 기본 공격 시 15의 추가 피해를 입히고 15골드를 획득합니다. 이 효과는 30초당 최대 3번 발동합니다. 미니언을 처치하면 12초 동안 이 지속 효과가 해제됩니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '스킬이나 기본 공격으로 적에게 피해를 입힐 때 골드를 획득합니다.'),
	(3100, '리치베인', '<stats>주문력 +80<br>이동 속도 +7%<br>재사용 대기시간 감소 +10%<br><mana>마나 +250</mana></stats><br><br><unique>고유 지속 효과 - 주문 검:</unique> 스킬을 시전한 다음 기본 공격 적중 시 기본 공격력의 75% (+ 주문력의 50%)에 해당하는 추가 마법 피해를 입힙니다. (재사용 대기시간 1.5초)', '스킬 공격 다음 공격에 추가 피해가 적용됩니다.'),
	(3101, '쐐기검', '<stats>공격 속도 +35%</stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%', '공격 속도와 재사용 대기시간 감소율이 증가합니다.'),
	(3102, '밴시의 장막', '<stats>체력 +300<br>마법 저항력 +70<br>기본 체력 재생 +100% </stats><br><br><unique>고유 지속 효과:</unique> 적의 다음번 스킬 공격을 막아주는 주문 보호막을 부여합니다. 이 보호막은 적 챔피언으로부터 40초 동안 공격 받지 않으면 재생성됩니다.', '주기적으로 적 스킬 공격을 막아줍니다.'),
	(3104, '반담 경의 철퇴', '<stats>체력 +300<br>공격력 +50<br>재사용 대기시간 +10%</stats><br><br><unique>고유 지속 효과 - 잿빛 회귀:</unique> 가까이 있는 제단을 차지하면 불길이 몸을 휘감아 근처 적에게 초당 25 (챔피언 레벨당 +1)의 마법 피해를 입힙니다. (미니언과 몬스터에게는 50%의 추가 피해를 입힙니다.) 멀리 있는 제단을 차지하면 기본 공격 시 3초간 최대 114의 고정 피해를 추가로 입힙니다. (챔피언 레벨에 따라 변동됩니다.)', '주변 적의 방어력이 감소합니다.'),
	(3105, '군단의 방패', '<stats>체력 +200<br>기본 체력 재생 +100% <br>마법 저항력 +20</stats><br><br><aura>고유 오오라 - 군단:</aura> 주변 아군의 마법 저항력이 +10 올라갑니다.', '주변 아군의 방어 관련 능력치를 높여줍니다.'),
	(3108, '악마의 마법서', '<stats>주문력 +30</stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%', '주문력과 재사용 대기시간 감소율이 증가합니다.'),
	(3110, '얼어붙은 심장', '<stats>방어력 +90<br>재사용 대기시간 감소 +20%<br><mana>마나 +400</mana></stats><br><br><aura>고유 오오���:</aura> 주변 적의 공격 속도를 15% 감소시킵니다.', '방어력이 대폭 증가하고, 적의 기본 공격이 느려집니다.'),
	(3111, '헤르메스의 발걸음', '<stats>마법 저항력 +25</stats><br><br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +45<br><unique>고유 지속 효과 - 강인함:</unique> 기절, 둔화, 도발, 공포, 침묵, 실명, 변이 및 이동 불가 효과의 지속 시간이 30% 감소됩니다.', '이동 속도가 증가하고, 방해 효과의 지속 시간이 줄어듭니다.'),
	(3112, '수호자의 보주', '<stats>체력 +150<br>주문력 +30<br><mana>5초당 마나 재생 +10</mana></stats><br><br><groupLimit>수호자 아이템은 1개만 소유할 수 있습니다.</groupLimit>', '마법사에게 특화된 시작 아이템입니다.'),
	(3113, '에테르 환영', '<stats>주문력 +30</stats><br><br><unique>고유 지속 효과:</unique> 이동 속도 +5%', '주문력과 이동 속도를 높여줍니다.'),
	(3114, '금지된 우상', '<stats><mana>기본 마나 재생 +50% </mana></stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%<br><unique>고유 지속 효과:</unique> 회복 및 보호막 효과 +10%', '마나 재생량과 재사용 대기시간 감소량이 증가합니다.'),
	(3115, '내셔의 이빨', '<stats>공격 속도 +50%<br>주문력 +80</stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +20%<br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 15 (+ 주문력의 15%)의 추가 마법 피해를 입힙니다.<br>', '공격 속도, 주문력, 재사용 대기시간 감소율이 증가합니다.'),
	(3116, '라일라이의 수정홀', '<stats>체력 +400<br>주문력 +100</stats><br><br><unique>고유 지속 효과:</unique> 상대에게 주문 및 스킬로 피해를 입히면 스킬 종류에 따라 대상의 이동 속도가 감소합니다:<br><br><passive>단일 대상:</passive> 1.5초 동안 40% 감소 <br><passive>광역 피해:</passive> 1초 동안 40% 감소<br><passive>지속 피해 및 여러 대상:</passive> 1초 동안 20% 감소<br><passive>소환된 미니언:</passive> 1초 동안 20% 감소<br><br><rules>(스킬이 여러 범주에 해당할 경우, 가장 약한 둔화 값이 적용됩니다.)</rules>', '스킬 공격으로 적이 둔화에 걸립니다.'),
	(3117, '기동력의 장화', '<unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +25. 5초 동안 전투에서 벗어나 있으면 이동 속도가 +115 상승합니다.', '전투에서 벗어나 있을 때는 이동 속도가 대폭 상승합니다.'),
	(3122, '흉악한 손도끼', '<stats>공격력 +20<br>치명타 확률 +10%</stats><br><br><unique>고유 지속 효과:</unique> 치명타 발동 시 대상이 출혈을 일으켜, 3초에 걸쳐 추가 공격력의 60%에 해당하는 마법 피해를 입고 위치가 드러납니다.', '치명타 발동 시 대상에게 출혈을 일으킵니다..'),
	(3123, '처형인의 대검', '<stats>공격력 +15</stats><br><br><unique>고유 지속 효과 - 처형인:</unique> 물리 피해를 가하면 적 챔피언에게 3초 동안 <a href=\'GrievousWounds\'>고통스러운 상처</a>를 남깁니다.', '회복력이 뛰어난 적에게 효과적입니다.'),
	(3124, '구인수의 격노검', '<stats>공격력 +35<br>주문력 +50</stats><br><br><passive>기본 지속 효과: </passive>기본 공격 적중 시 15의 추가 마법 피해를 입힙니다.<br><unique>고유 지속 효과:</unique> 기본 공격 시 5초 동안 공격 속도가 +8%, 공격력이 +3, 주문력이 +4 오릅니다. (6번까지 중첩됩니다.) 6중첩이 쌓여 있는 동안에는 <unlockedPassive>구인수의 격노</unlockedPassive>가 적용됩니다.<br><br><unlockedPassive>구인수의 격노:</unlockedPassive> 기본 공격 시 다음 기본 공격에 적중 시 효과가 추가로 적용됩니다.', '주문력과 공격력이 증가합니다.'),
	(3133, '콜필드의 전투 망치', '<stats>공격력 +25</stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%', '공격력과 재사용 대기시간 감소율이 증가합니다.'),
	(3134, '톱날 단검', '<stats>공격력 +20</stats><br><br><unique>고유 지속 효과:</unique> <a href=\'FlatArmorPen\'>방어구 관통력</a> +10<br><unique>고유 지속 효과:</unique> 유닛을 처치하면 다음 기본 공격이나 단일 대상 스킬이 +15의 추가 피해를 입힙니다.', '공격력과 방어구 관통력이 증가합니다.'),
	(3135, '공허의 지팡이', '<stats>주문력 +80</stats><br><br><unique>고유 지속 효과:</unique> <a href=\'TotalMagicPen\'>마법 관통력</a> +35%', '마법 피해량이 증가합니다.'),
	(3136, '기괴한 가면', '<stats>주문력 +25<br>체력 +200</stats><br><br><unique>고유 지속 효과 - 아픈 눈:</unique> <a href=\'FlatMagicPen\'>마법 관통력</a> +15', '마법 피해량이 증가합니다.'),
	(3137, '광신도의 검', '<stats>공격 속도 +50%<br>마법 저항력 +45<br>재사용 대기시간 감소 +10%</stats><br><br><active>고유 사용 효과 - 수은:</active> 챔피언에 걸린 모든 해로운 효과를 제거하고, 근접 챔피언의 경우 1초 동안 이동 속도를 +50% 올려줍니다. (재사용 대기시간 90초)', '사용하면 모든 해로운 효과가 제거되며, 이동 속도가 대폭 증가합니다.'),
	(3139, '헤르메스의 시미터', '<stats>공격력 +65<br>마법 저항력 +35<br>생명력 흡수 +10%</stats><br><br><active>고유 사용 효과 - 수은:</active> 챔피언에 걸린 모든 군중 제어 효과를 제거하고, 1초 동안 이동 속도를 +50% 올려줍니다. (재사용 대기시간 90초)', '사용하면 모든 군중 제어 효과가 제거되며, 이동 속도가 대폭 증가합니다.'),
	(3140, '수은 장식띠', '<stats>마법 저항력 +30</stats><br><br><active>고유 사용 효과 - 수은:</active> 챔피언에게 걸린 모든 군중 제어 효과를 제거합니다. (재사용 대기시간 90초)', '사용하면 모든 군중 제어 효과가 제거됩니다.'),
	(3142, '요우무의 유령검', '<stats>공격력 +60<br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과:</unique> <a href=\'FlatArmorPen\'>방어구 관통력</a> +20<br><active>고유 사용 효과:</active> 6초 동안 이동 속도가 +20%, 공격 속도가 +40% 증가합니다. (재사용 대기시간 45초)', '사용하면 이동 속도와 공격 속도가 대폭 상승합니다.'),
	(3143, '란두인의 예언', '<stats>체력 +500<br>방어력 +60<br>치명타로 입는 피해량 -10%</stats><br><br><unique>고유 지속 효과 - 차가운 강철:</unique>기본 공격에 맞으면 1초 동안 공격한 챔피언의 공격 속도가 15% 감소합니다.<br><active>고유 사용 효과:</active> 주변 적 유닛의 이동 속도를 4초 동안 35%만큼 둔화시킵니다. (재사용 대기시간 60초)', '방어력이 대폭 강화됩니다. 사용하면 주변 적들이 둔화에 걸립니다.'),
	(3144, '빌지워터 해적검', '<stats>공격력 +25<br>생명력 흡수 +10%</stats><br><br><active>고유 사용 효과:</active> 100의 마법 피해를 입히고 대상 챔피언에게 2초 동안 25%의 둔화 효과를 부여합니다. (재사용 대기시간 90초)', '사용하면 마법 피해를 가하고 적 챔피언을 둔화시킵니다.'),
	(3145, '마법공학 리볼버', '<stats>주문력 +40</stats><br><br><unique>고유 지속 효과 - 마법 탄환:</unique> 적 챔피언에게 기본 공격으로 피해를 입히면 추가로 <levelScale>75 - 150</levelScale>의 마법 피해도 입힙니다. (재사용 대기시간은 40초이며, 다른 <font color=\'#9999FF\'><a href=\'itembolt\'>마법공학</a></font> 아이템과 재사용 대기시간을 공유합니다.)<br><br>아이템 고유 사용 효과의 재사용 대기시간이 감소하면 마법 탄환의 재사용 대기시간도 감소합니다.<br><br><rules>(피해량은 레벨에 비례하며, 마법공학 효과는 다른 아이템 효과를 발동시킬 수 있습니다.)</rules>', '주문력이 상승합니다. 공격 시 주기적으로 추가 마법 피해를 입힙니다.'),
	(3146, '마법공학 총검', '<stats>공격력 +40<br>주문력 +80</stats><br><br><unique>고유 지속 효과:</unique> 적에게 가한 피해량의 15%만큼 회복합니다. 이 효과는 범위 피해에는 33%만 적용됩니다.<br><active>고유 사용 효과 - 번개:</active> 250 (+ 주문력의 30%)의 마법 피해를 입히고 대상 챔피언을 2초 동안 40% 둔화시킵니다. (재사용 대기시간은 40초이며, 다른 <font color=\'#9999FF\'><a href=\'itembolt\'>마법공학</a></font> 아이템과 재사용 대기시간을 공유합니다.)', '공격력과 주문력이 증가합니다. 사용하면 대상이 둔화에 걸립니다.'),
	(3147, '드락사르의 황혼검', '<stats>공격력 +75<br>이동 속도 +5%</stats><br><br><unique>고유 지속 효과:</unique> <a href=\'FlatArmorPen\'>방어구 관통력 +10</a><br><unique>고유 지속 효과:</unique> 적 챔피언에게 기본 공격 시 <unlockedPassive>일몰</unlockedPassive> 효과가 적용됩니다. (재사용 대기시간 120초)<br><br><unlockedPassive>일몰:</unlockedPassive> 2초 뒤 대상이 잃은 체력의 25% + 90에 해당하는 물리 피해를 입힙니다. 일몰이 끝나기 전 대상을 상대로 킬이나 어시스트를 올리면 재사용 대기시간이 초기화됩니다.', '공격을 적중시키면 잠시 후 큰 피해를 입힙니다.'),
	(3151, '리안드리의 고통', '<stats>주문력 +80<br>체력 +300</stats><br><br><unique>고유 지속 효과 - 아픈 눈:</unique> <a href=\'FlatMagicPen\'>마법 관통력</a> +15<br><unique>고유 지속 효과:</unique> 스킬 공격에 맞은 적에게 3초에 걸쳐 매 초 대상의 현재 체력의 2%에 해당하는 초당 추가 마법 피해를 입힙니다. 이 추가 피해량은 <a href=\'MovementImpaired\'>이동 방해</a>에 걸린 유닛에게는 두 배로 적용됩니다.', '스킬 공격���로 피해를 입히면 적이 불에 타서 체력의 일정 비율을 잃습니다.'),
	(3152, '마법공학 초기형 벨트-01', '<stats>체력 +300<br>주문력 +60<br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 사용 효과 - 화염 탄환:</unique> 앞으로 돌진해 <levelScale>75 - 150</levelScale> (+주문력의 35%)의 마법 피해를 입히는 화염 탄환을 방사형으로 발사합니다. (재사용 대기시간은 40초이며, 다른 <font color=\'#9999FF\'><a href=\'itembolt\'>마법공학</a></font> 아이템과 재사용 대기시간을 공유합니다.)<br><br>챔피언이나 몬스터가 화염 탄환을 여러 발 맞을 경우 추가되는 탄환 하나당 20%의 피해를 입습니다.<br><br><rules>(돌진으로 지형은 통과할 수 없습니다.)</rules>', '사용시 앞으로 돌진하며 강력한 폭발을 일으키는 탄환을 발사합니다.'),
	(3153, '몰락한 왕의 검', '<stats>공격력 +25<br>공격 속도 +40%<br>생명력 흡수 +10%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상의 현재 체력의 6%에 해당하는 추가 물리 피해를 입힙니다. (몬스터, 미니언 대상으로는 최대 60)<br><active>고유 사용 효과:</active> 적 챔피언 최대 체력의 10%(최소 100)에 해당하는 물리 피해를 입히고 그만큼 스스로 회복하며, 대상 이동 속도의 25%를 3초 동안 훔칩니다. (재사용 대기시간 90초)', '상대의 체력에 비례하여 피해를 입히고, 상대의 체력과 이동 속도를 훔칠 수 있습니다.'),
	(3155, '주문포식자', '<stats>공격력 +20<br>마법 저항력 +35</stats><br><br><unique>고유 지속 효과 - 생명선:</unique> 마법 피해를 받아 체력이 30% 이하가 될 경우, 먼저 110에서 280의 마법 피해(레벨에 비례)를 흡수하는 보호막을 5초 동안 생성합니다. (재사용 대기시간 90초)', '공격력과 마법 저항력이 증가합니다.'),
	(3156, '맬모셔스의 아귀', '<stats>공격력 +55<br>마법 저항력 +40<br><a href=\'FlatArmorPen\'>방어구 관통력</a> +10</stats><br><br><unique>고유 지속 효과 - 생명선:</unique> 마법 피해를 받아 체력이 30% 이하가 될 경우, 5초 동안 추가 마법 저항력당 300 + 1에 해당하는 마법 피해를 흡수하는 보호막을 생성합니다. (재사용 대기시간 90초)<br><unlockedPassive>생명의 힘:</unlockedPassive> <i>생명선</i> 효과가 발동되면 전투에서 벗어날 때까지 주문 흡혈이 +10%, 생명력 흡수가 +10% 증가합니다.', '체력이 낮아지면 추가 공격력이 부여됩니다.'),
	(3157, '존야의 모래시계', '<stats>주문력 +70<br>방어력 +45<br>재사용 대기시간 감소 +10%</stats><br><br><active>고유 사용 효과 - 경직:</active> 챔피언이 2.5초 동안 아무런 행동도 취할 수 없는 대신 공격도 받지 않는 무적 상태가 됩니다. (재사용 대기시간 120초)', '사용하면 아무런 행동도 취할 수 없는 대신 공격도 받지 않는 무적 상태가 됩니다.'),
	(3158, '명석함의 아이오니아 장화', '<unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%<br><unique>고유 지속 효과 - 이동 속도 향상:</unique> 이동 속도 +45<br><unique>고유 지속 효과:</unique> 소환사 주문의 재사용 대기시간을 10%만큼 줄입니다.<br><br><br><rules><font color=\'#FDD017\'>CLE 20년 12월 10일 남부 지방의 패권을 두고 벌어진 녹서스와의 재경합에서 아이오니아의 승리를 기념하는 헌정 아이템입니다.\'\'</font></rules>', '이동 속도와 재사용 대기시간 감소율이 증가합니다.'),
	(3165, '모렐로노미콘', '<stats>주문력 +100<br><mana>마나 +400</mana></stats><br><br><unique>고유 지속 효과:</unique>재사용 대기시간 감소 +20%<br><unique>고유 지속 효과:</unique> 체력이 35% 이하인 챔피언에게 마법 피해를 가해 8초 동안 <a href=\'GrievousWounds\'>고통스러운 상처</a> 효과를 적용합니다.<br><unique>고유 지속 효과:</unique> 챔피언을 처치하거나 어시스트를 올리면 최대 마나의 20%를 회복합니다.', '주문력과 재사용 대기시간 감소량이 대폭 증가합니다.'),
	(3170, '달빛 마법검', '<stats>주문력 +50<br>방어력 +50<br>마법 저항력 +50</stats><br><br><unique>고유 지속 효과 - 강인함:</unique> 기절, 둔화, 도발, 공포, 침묵, 실명, 변이 및 이동 불가 효과의 지속 시간을 35% 줄여줍니다.', '방어력이 증가하고, 방해 효과의 지속 시간이 줄어듭니다.'),
	(3174, '아테나의 부정한 성배', '<stats>주문력 +40<br>마법 저항력 +25<br>재사용 대기시간 감소 +20%<br><mana>기본 마나 재생 +75% </mana></stats><br><br><unique>고유 지속 효과:</unique> 챔피언에게 피해를 입혔을 때, <a href=\'premitigation\'><font color=\'#6666FF\'><u>감소 전</u></font></a> 피해량의 20%를 최대 <levelScale>100 - 250</levelScale>까지 피의 중첩으로 쌓습니다. 아군의 체력을 회복시키거나 보호막을 씌울 때 피의 중첩을 소모해 중첩이 쌓인 만큼 회복시킵니다.<br><unique>고유 지속 효과:</unique> 현재 체력 %가 마나 %보다 낮으면 기본 체력 재생이 100% 증가합니다. <mana>현재 마나 %가 체력 %보다 낮으면 기본 마나 재생이 100% 증가합니다.</mana><br><br><rules>(피의 중첩 최대치는 레벨에 따라 늘어납니다. 중첩으로 인한 추가 회복량은 총 회복량에 적용됩니다.)</rules>', '적에게 피해를 입혀 회복과 보호막을 강화합니다.'),
	(3181, '핏빛 칼날', '<stats>공격력 +45<br>생명력 흡수 +10%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 8초 동안 공격력이 +6만큼, 생명력 흡수율이 +1% 증가합니다. (최대 5번까지 중첩)', '공격력과 생명력 흡수량이 대폭 상승합니다.'),
	(3184, '수호자의 망치', '<stats>체력 +150<br>공격력 +15<br>생명력 흡수 +10%</stats><br><br><groupLimit>수호자 아이템은 1개만 소유할 수 있습니다.</groupLimit>', '공격에 특화된 시작 아이템입니다.'),
	(3185, '빛의 인도자', '<stats>공격력 +30<br>치명타 확률 +30%</stats><br><br><unique>고유 지속 효과:</unique> 치명타 발동 시 적이 출혈을 일으켜, 3초에 걸쳐 추가 공격력의 90%에 해당하는 마법 피해를 입고 위치가 드러납니다.<br><unique>고유 지속 효과 - 덫 감지:</unique> 근처에 있는 보이지 않는 적의 덫을 드러내 줍니다.<br><active>고유 사용 효과 - 사냥꾼의 시야:</active> 특정 지역을 은신 감지용 안개로 뒤덮어 5초 동안 해당 지역을 볼 수 있게 되며, 여기 들어오는 적 챔피언들을 3초 동안 드러내 줍니다. (재사용 대기시간 60초)', '치명타 발동 시 대상에게 출혈을 일으키고 위치를 드러냅니다.'),
	(3187, '비전 탐지기', '<stats>체력 +225<br>마나 +250<br>방어력 +25<br>재사용 대기시간 감소 +20%</stats><br><br><unique>고유 지속 효과 - 덫 감지:</unique> 근처에 있는 보이지 않는 적의 덫을 드러내줍니다.<br><active>고유 사용 효과 - 사냥꾼의 시야:</active> 특정 지역을 은신 감지용 안개로 뒤덮어 5초 동안 해당 지역을 볼 수 있게 되며, 여기 들어오는 적 챔피언들을 3초 동안 드러내줍니다. (재사용 대기시간 60초)', '사용하면 주변 지역의 시야를 밝혀줍니다.'),
	(3190, '강철의 솔라리 펜던트', '<stats>체력 +400<br>기본 체력 재생 +100% <br>마법 저항력 +20<br>재사용 대기시간 감소 +10%</stats><br><br><active>고유 사용 효과:</active> 2초간 근처 아군들을 보호막으로 감싸 최대 75 (레벨 당 +15)의 피해를 흡수합니다. (재사용 대기시간 60초) 최근에 같은 보호막을 받은 유닛에게는 효과가 절반으로 줄어듭니다.<br><aura>고유 오오라 - 군단:</aura> 주변의 아군은 마법 저항력이 +15 올라갑니다.', '사용하면 주변 아군을 적의 공격에서 방어해 줍니다.'),
	(3191, '추적자의 팔목 보호대', '<stats>방어력 +30<br>주문력 +20</stats><br><br><unique>고유 지속 효과:</unique> 유닛을 하나 처치하면 방어력과 주문력이 추가로 0.5 오릅니다. 이 효과는 최대 30번까지 중첩됩니다.', '방어력과 주문력이 증가합니다.'),
	(3196, '마공학 핵 mk-1', '<stats>레벨당 주문력 +3<br>레벨당 마나 +15</stats><br><br><unique>고유 지속 효과 - 진보:</unique> 빅토르가 기본 스킬 중 하나를 업그레이드할 수 있습니다.', '빅토르가 선택한 스킬을 강화할 수 있게 해 줍니다.'),
	(3197, '마공학 핵 mk-2', '<stats>레벨당 주문력 +6<br>레벨당 마나 +20</stats><br><br><unique>고유 지속 효과 - 진보:</unique> 빅토르가 기본 스킬 중 하나를 업그레이드할 수 있습니다.', '빅토르가 선택한 스킬을 강화할 수 있게 해 줍니다.'),
	(3198, '완성형 마공학 핵', '<stats>레벨당 주문력 +10<br>레벨당 마나 +25</stats><br><br><unique>고유 지속 효과 - 영광스러운 진화:</unique> 빅토르가 힘의 정점에 도달하여, 기본 스킬과 더불어 혼돈의 폭풍 스킬을 업그레이드합니다.', '빅토르가 선택한 스킬을 강화할 수 있게 해 줍니다.'),
	(3200, '프로토타입 마공학 핵', '<stats>레벨당 주문력 +1<br>레벨당 마나 +10</stats><br><br><unique>고유 지속 효과 - 진보:</unique> 이 아이템은 세 번 업그레이드하여 빅토르의 기본 스킬을 강화할 수 있습니다.', '주문력이 상승하고, 업그레이드하면 빅토르의 스킬을 강화할 수 있습니다.'),
	(3211, '망령의 두건', '<stats>체력 +250<br>마법 저항력 +30</stats><br><br><unique>고유 지속 효과:</unique> 적 챔피언으로부터 피해를 입은 후 최대 10초 동안 기본 체력 재생 150%가 부여됩니다.', '방어력이 증가하고, 피해를 입으면 체력이 재생됩니다.'),
	(3222, '미카엘의 도가니', '<stats>마법 저항력 +35<br>재사용 대기시간 감소 +10%<br><mana>기본 마나 재생 +150% </mana></stats><br><br><unique>고유 지속 효과:</unique> 회복 및 보호막 효과 +15%<br><unique>고유 지속 효과:</unique> 현재 체력 %가 마나 %보다 낮으면 기본 체력 재생이 100% 증가합니다. <mana>현재 마나 %가 체력 %보다 낮으면 기본 마나 재생이 100% 증가합니다.</mana><br><active>고유 사용 효과:</active> 아군 챔피언에게 걸린 기절, 속박, 도발, 공포, 침묵, 둔화 효과를 제거하고 대상의 체력을 150 (+ 최대 체력의 10%)만큼 치유해 줍니다. (재사용 대기시간 180초)', '사용하면 아군 챔피언 하나를 치유하며 방해 효과를 모두 제거해 줍니다.'),
	(3285, '루덴의 메아리', '<stats>주문력 +100<br>이동 속도 +10%</stats><br><br><unique>고유 지속 효과 - 메아리:</unique> 이동하거나 주문을 시전할 때 전류가 충전됩니다. 충전량이 100이 되면 다음 스킬로 피해를 입혔을 때 충전된 전류를 전부 방출해, 최대 4명의 적에게 100 (+ 주문력의 10%)에 해당하는 적중 시 마법 피해를 추가로 입힙니다.', '이동 및 주문 시전 시 점차 충전되어, 다음 스킬 사용 시 연쇄 번개를 발사합니다.'),
	(3301, '고대 주화', '<stats><mana>기본 마나 재생 +25% </mana><br>재사용 대기시간 감소 +5%</stats><br><br><unique>고유 지속 효과 - 나눠받기:</unique> 주변에서 내가 최후의 일격을 가하지 않은 미니언이 쓰러지면 4골드와 5의 체력을 얻습니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><i><font color=\'#447777\'>\'\'사막에서 금가루가 솟아올라 주화에 달라붙는다.\'\' - 역사가 슈렐리아, CLE 23년 11월 11일</font></i>', '주변에서 내가 처치하지 않은 적 미니언이 쓰러질 때마다 골드를 획득합니다.'),
	(3302, '고대유물 방패', '<stats>체력 +75<br>10초당 골드 +2 </stats><br><br><unique>고유 지속 효과 - 전리품:</unique> 근접 기본 공격 시 체력이 195 (레벨 당 +5) 이하인 미니언이 처치됩니다. 미니언을 처치하면 자신과 더불어 가장 가까이 있는 아군 챔피언의 체력이 15씩 회복되며, 둘에게 처치한 골드가 부여됩니다.<br><br>이 효과는 근처에 아군이 있어야 하며, 40초마다 재충전됩니다. (최대 충전량 2회)<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '주기적으로 미니언을 처치하여 근처 아군을 치유하고 골드를 부여합니다.'),
	(3303, '주문도둑의 검', '<stats>주문력 +5<br>10초당 골드 +2<br><mana>기본 마나 재생 +25% </mana></stats><br><br><unique>고유 지속 효과 - 헌납:</unique> 챔피언과 구조물에 대한 스킬과 기본 공격 시 10의 추가 피해를 입히고 8골드를 획득합니다. 이 효과는 30초당 최대 3번 발동합니다. 미니언을 처치하면 12초 동안 이 지속 효과가 해제됩니다.<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '적을 공격할 때 골드를 획득합니다.'),
	(3340, '와드 토템 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 효과:</active> 충전량을 1 소모하여 <levelScale>60 - 120</levelScale>초 동안 주변을 드러내 주는 보이지 않는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. <br><br> 매 <levelScale>180 - 90</levelScale>초마다 1회 충전되며 최대 2회까지 충전됩니다. <br><br>와드 지속 시간과 충전 주기는 레벨이 오를 수록 향상됩니다.<br><br><rules>(플레이어 당 맵에 설치할 수 있는 <font color=\'#BBFFFF\'>투명 와드</font>는 3개로 제한됩니다. <font color=\'#BBFFFF\'>렌즈</font> 유형의 장신구로 교체 시 120초간 <font color=\'#BBFFFF\'>장신구</font>를 사용할 수 없습니다.)</rules>', '주기적으로 투명 와드를 설치합니다.'),
	(3341, '탐지용 렌즈 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 시:</active> 6초 동안 일정 범위에 숨어있는 적대적 유닛을 대상으로 경고를 하며 투명한 덫과 투명 와드를 드러내서 차단합니다. (재사용 대기시간 90 - 60초)<br><br>시전 거리와 탐지 반경은 레벨이 오를수록 향상됩니다.<br><br><rules>(<font color=\'#BBFFFF\'>토템</font> 유형의 장신구로 교체 시 120초간 <font color=\'#BBFFFF\'>장신구</font>를 사용할 수 없습니다.)</rules>', '근처의 투명한 와드와 덫을 감지하여 차단합니다.'),
	(3345, '영혼의 닻 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 효과:</active> 충전량을 1회 소모하여, 소환사의 제단에서 챔피언을 즉시 부활시키며 이동 속도가 125% 상승한 후 12초에 걸쳐 정상으로 돌아옵니다.<br><br><rules>9레벨과 14레벨 달성 시 추가 충전됩니다.</rules><br><br><font color=\'#BBFFFF\'>(최대 충전량: 2)</font></rules><br><br>', '충전량을 소모하여 챔피언을 부활시킵니다.'),
	(3348, '비전 탐지기', '<active>고유 사용 효과 - 사냥꾼의 시야:</active> 특정 지역을 은신 감지용 안개로 뒤덮어 5초 동안 해당 지역을 볼 수 있게 되며, 3초 동안 안개 안으로 들어오는 적 챔피언들과 덫을 드러내 줍니다. (재사용 대기시간 90초)', '사용하면 주변 지역의 시야를 밝혀줍니다.'),
	(3361, '상급 투명 토템 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><levelLimit> 업그레이드하려면 9레벨 이상이 되어야 합니다.</levelLimit><stats></stats><br><br><unique>고유 사용 효과:</unique> 충전량을 1 소모하여, 180초 동안 유지되며 주변을 드러내 주는 투명한 와드를 설치합니다. 매 60초마다 충전량이 1 저장되어 최대 2회까지 충전됩니다. 플레이어 당 맵에 설치할 수 있는 <font color=\'#BBFFFF\'>투명 와드</font>는 3개로 제한됩니다.<br><br><rules>(장신구는 게임 시작 후 30초 동안은 사용할 수 없습니다. 장신구를 하나 판매하면 이후 120초 동안 장신구 사용이 불가능합니다.)</rules>', '주기적으로 투명 와드를 설치합니다.'),
	(3362, '상급 투명 감지 토템 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><levelLimit> 업그레이드하려면 9레벨 이상이 되어야 합니다.</levelLimit><stats></stats><br><br><unique>고유 사용 효과:</unique> 파괴될 때까지 주변 지역과 투명한 유닛을 드러내 주는 불투명한 와드를 설치합니다. (재사용 대기시간 120초) 플레이어 당 맵에 설치할 수 있는 <font color=\'#BBFFFF\'>투명 감지 와드</font>는 1개로 제한됩니다.<br><br><rules>(장신구는 게임 시작 후 30초 동안은 사용할 수 없습니다. 장신구를 하나 판매하면 이후 120초 동안 장신구 사용이 불가능합니다.)</rules>', '주기적으로 투명 감지 와드를 설치합니다.'),
	(3363, '망원형 개조', '<levelLimit>업그레이드하려면 9레벨 이상 필요</levelLimit><br><br><font color=\'#FFFFFF\'>와드 토템</font> 장신구 업그레이드 시:<br><br><stats><font color=\'#00FF00\'>+</font> 설치 가능 범위 대폭(+650%) 증가 <br><font color=\'#00FF00\'>+</font> 지속 시간 제한 없음, 와드 설치 개수 제한에 관계 없음<br><font color=\'#FF0000\'>-</font> 재사용 대기시간 증가 <font color=\'#FF6600\'>10%</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>누구나 볼 수 있는 와드로, 쉽게 파괴 가능하고 아군의 대상으로 지정될 수 없음</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>와드 시야 범위 45% 감소</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>상점 방문 시 충전되지 않음</font></stats>', '설치 범위가 증가하며 대상 지역을 드러내 줍니다.'),
	(3364, '예언자형 개조', '<levelLimit>업그레이드하려면 9레벨 이상 필요</levelLimit><stats></stats><br><br><font color=\'#FFFFFF\'>탐지용 렌즈</font> 장신구 업그레이드 시:<br><br><stats><font color=\'#00FF00\'>+</font> 탐지 범위 증가<br><font color=\'#00FF00\'>+</font> 10초 동안 탐지 효과가 시전자를 따라 다님<br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>설치 범위가 0으로 감소</font></stats>', '근처의 투명한 와드와 덫을 일정 시간 동안 차단합니다.'),
	(3401, '산악 방벽', '<stats>체력 +450<br>기본 체력 재생 +100% <br>재사용 대기시간 감소 +10%<br>10초당 골드 +2</stats><br><br><unique>고유 지속 효과 - 전리품:</unique> 근접 기본 공격 시 체력이 320 (레벨 당 +20) 이하인 미니언이 처치됩니다. 미니언을 처치하면 자신과 더불어 가장 가까이 있는 아군 챔피언의 체력을 50씩 치유하며, 둘에게 처치한 골드가 부여됩니다. 이 효과는 근처에 아군이 있어야 하며, 30초마다 재충전됩니다. (최대 충전량 4번)<br><unique>고유 사용 효과:</unique> 4초 동안 대상 아군에게 내 최대 체력의 10%에 해당하는 보호막을 씌웁니다. 4초가 지나면 보호막이 폭발하여 근처 적들에게 2초간 40%의 둔화를 겁니다. (재사용 대기시간 60초)<br><br><groupLimit>골드 획득 아이템은 1개로 소지가 제한됩니다.</groupLimit>', '내 체력에 비례하여 아군을 피해로부터 보호합니다.'),
	(3460, '황금 초월 장치', '<unique>사용 시:</unique> 이 장신구를 사용해 전투 제단 중 하나로 순간 이동합니다. 소환사의 제단에서만 사용할 수 있습니다.<br><br><i><font color=\'#FDD017\'>\'\'이 절벽에서 챔피언이 소멸했다가 다시 만들어지고, 마법을 부여받습니다.\'\'</font></i>', NULL),
	(3461, '황금 초월 장치 (비활성화)', '<unique>사용 시:</unique> 이 장신구를 사용해 전투 제단 중 하나로 순간 이동합니다. 소환사의 제단에서만 사용할 수 있습니다.<br><br><i><font color=\'#FDD017\'>\'\'이 절벽에서 챔피언이 소멸했다가 다시 만들어지고, 마법을 부여받습니다.\'\'</font></i>', NULL),
	(3462, '예언석 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 효과:</active> 3초 동안 반경 <font color=\'#FFFFF\'>2500</font> 내의 작은 지역을 드러냅니다. 발각된 적 챔피언들은 5초 동안 위치가 드러납니다. (재사용 대기시간 60초)', '잠깐 근처의 지정한 범위를 드러내 줍니다.'),
	(3504, '불타는 향로', '<stats>주문력 +60<br>재사용 대기시간 감소 +10%<br><mana>기본 마나 재생 +50% </mana></stats><br><br><unique>고유 지속 효과:</unique> 회복 및 보호막 효과 +15%<br><unique>고유 지속 효과:</unique> 이동 속도 +8%<br><unique>고유 지속 효과:</unique> 아군 챔피언을 치유하거나 보호막을 씌워주면 6초간 대상의 공격 속도가 15% 상승하고 적중 시 30의 마법 피해가 적용됩니다.<br><br><rules>(재생 효과나 자기 자신에 대한 효과에는 발동되지 않습니다.)</rules>', '다른 ���닛에게 보호막과 치유 효과를 쓰면 잠깐동안 대상의 공격 속도가 상승하고 추가 피해를 가하게 해줍니다.'),
	(3508, '정수 약탈자', '<stats>공격력 +70<br>치명타 확률 +20%</stats><br><br><unique>고유 지속 효과:</unique> 재사용 대기시간 감소 +10%<br><unique>고유 지속 효과:</unique> 다른 효과로 얻는 치명타 확률에 따라 재사용 대기시간이 추가로 감소합니다. (치명타 확률 30%일 때 추가 재사용 대기시간 감소 최대 +20%)<br><unique>고유 지속 효과:</unique> 치명타 발동 시 최대 마나의 3%를 회복합니다.', '치명타 발동 시 재사용 대기시간이 감소하고 마나가 회복됩니다.'),
	(3512, '즈롯 차원문', '<stats>방어력 +55<br>마법 저항력 +55<br>기본 체력 재생 +125% <br></stats><br><unique>고유 지속 효과 - 단거리 주자:</unique> 포탑이나 무너진 포탑, 공허의 문 근처에서는 2초에 걸쳐 이동 속도가 최대 +20%까지 상승합니다.<br><active>고유 사용 효과:</active> 150초 동안 유지되는 <a href=\'VoidGate\'>공허의 문</a>을 생성합니다. (재사용 대기시간 150초)<br><br>매 4초마다 문에서 <a href=\'Voidspawn\'>공허 생물</a>이 생성됩니다. 최초의 공허 생물과 이후 매 네 번째 생성되는 공허 생물에게는 최대 체력의 15%에 해당하는 피해량이 부여됩니다.', '공허 생물을 생성하는 공허의 문을 만들어 공격로를 압박합니다.'),
	(3599, '칠흑의 창', '<stats></stats><br><active>사용 효과:</active> 아군에게 이 게임 동안 결속되는 계약을 제의합니다. 계약이 수락되면 해당 아군과 가까이 있을 때 둘이 모두 강화됩니다.', '아군 계약자에게 결속시키는 칼리스타의 창입니다.'),
	(3630, '순간이동 장치', '<unique>사용 시:</unique> 이 장신구를 사용하면 팀의 순간이동 지점 중 하나로 순간이동합니다. 소환사의 제단에서만 사용할 수 있습니다.', NULL),
	(3631, '공성 투석기', '<br><font color=\'#FF9900\'>가장 가까이에 있는 포탑을 공격하는 투석기를 설치합니다.</font><br><br>적 포탑으로부터 사거리 2200 안에 있는 장거리 투석기를 설치합니다. 투석기는 5초 후부터 가장 가까운 적 포탑을 공격해 막대한 피해를 입힙니다. 대상 포탑이 파괴되면 투석기도 파괴됩니다.', '포탑 파괴용 장거리 투석기를 설치합니다.'),
	(3632, NULL, NULL, NULL),
	(3633, '순간이동 장���', '<unique>사용 시:</unique> 이 장신구를 사용하면 팀의 순간이동 지점 중 하나로 순간이동합니다. 소환사의 제단에서만 사용할 수 있습니다.', NULL),
	(3634, '포탑: 파멸 광선', '<br><font color=\'#FF9900\'>포탑에 장착한 후 다시 사용하면 마우스 커서 방향으로 파멸 광선을 발사해 큰 피해를 입힙니다.</font><br><br><font color=\'#FF9900\'>첫 번째 사용 시:</font> 지정한 포탑에 3회 발사 가능한 파멸 광선 장치를 장착합니다.<br></br><font color=\'#FF9900\'>다음 3회 사용 시:</font> 마우스 커서 방향으로 파멸 광선을 발사해 직선상의 모든 적에게 레벨 당 30 + 대상 최대 체력의 30%에 해당하는 마법 피해를 입힙니다. (미니언에게는 20%의 피해)<br></br><br></br>파멸 광선 장치는 15초 동안 유지되며 3회 발사 시 파괴됩니다.</mainText>', '세 번 조준하여 발사 가능한 광선 장치를 포탑에 장착합니다.'),
	(3635, '순간이동 지점 생성기', '<br><font color=\'#FF9900\'>순간이동 지점을 하나 더 생성합니다.</font><br><br>지정한 위치에 순간이동 지점을 생성합니다. 장치가 4초 후 가동을 시작하면 아군 팀이 기지에서 지점으로 순간이동할 수 있습니다.', '아군 팀이 순간이동할 수 있는 지점을 하나 더 생성합니다.'),
	(3636, '포탑: 폭풍 방벽', '<br><font color=\'#FF9900\'>포탑을 무적 상태로 만든 뒤 화염을 퍼붓습니다.</font><br><br>포탑을 6초 동안 무적 상태로 만듭니다. 지속 시간 종료 2초 전, 화염이 발사되며 남은 시간 동안 근처의 모든 적에게 650의 고정 피해를 입힙니다.<br><br>같은 포탑에는 15초 동안 다시 사용할 수 없습니다.', '강력한 화약을 충전하는 도중 포탑을 무적 상태로 만들어 줍니다.'),
	(3637, '넥서스 공성전: 공성 병기 장착 칸', '넥서스 공성전 중에는 소환사 주문이 공성 병기 장착 칸으로 바뀝니다. 상점에서 수정 파편을 이용해 공성 병기를 구매한 뒤 소환사 주문 키로 사용할 수 있습니다.', NULL),
	(3640, '점멸 지대', '<br><font color=\'#FF9900\'>지대 안에서 아군 팀은 계속해서 점멸을 사용할 수 있습니다.</font><br><br>5초 동안 유지되는 마법 지대를 생성합니다. 아군 팀은 지대 안으로 들어오면 모두 소환사 주문이 점멸로 바뀌고, 지대 안에서는 계속해서 점멸을 사용할 수 있습니다. (재사용 대기시간 1초)', '지대 안에서 아군 팀 전체가 계속해서 점멸을 사용할 수 있습니다.'),
	(3641, '선봉대의 깃발', '<br><font color=\'#FF9900\'>미니언을 강화시키는 깃발을 설치합니다.</font><br><br>지정한 위치에 수호자 깃발을 설치합니다. 2초 후부터 근처의 미니언에게 이로운 효과가 적용되어 범위 내에 있는 동안 공격력이 50%, 방어력이 50, 마법 저항력이 100 만큼 증가합니다.', '근처의 미니언을 강화시킵니다.'),
	(3642, '공성 병기 반환', '구매한 모든 공성 병기를 반환하고 구매에 사용한 수정 파편을 돌려 받습니다.', '구매한 모든 공성 병기를 반환하고 구매에 사용한 수정 파편을 돌려 받습니다.'),
	(3643, '엔트로피 지대', '<br><font color=\'#FF9900\'>지대 안의 미니언을 기절시키고 챔피언을 둔화시킵니다.</font><br><br>지정한 위치에 5초 동안 유지되는 엔트로피 지대를 생성합니다. 지대 내부에 갇힌 적 미니언과 공성 투석기는 이동 및 공격을 할 수 없습니다. 지대 내부의 적 챔피언은 이동 속도가 25%만큼 둔화됩니다.', '적 미니언을 기절시키고 적 챔피언을 둔화시키는 지대를 생성합니다.'),
	(3645, '시야석 (장신구)', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 효과:</active> 3초 동안 반경 <font color=\'#FFFFF\'>1400</font> 내의 작은 지역을 드러냅니다. 발각된 적 챔피언들은 5초 동안 위치가 드러납니다. (재사용 대기시간 60초)', '잠깐 근처의 지정한 범위를 드러내 줍니다.'),
	(3647, '보호막 토템', '<br><font color=\'#FF9900\'>주변 병기에 보호막을 씌우는 토템을 설치합니다.</font><br><br>지정한 위치에 보호막 토템을 설치합니다. 2초 후부터 토템이 활성화되어 근처의 모든 병기에 2(추가 보호막 토템 하나 당 +1)의 보호막을 씌웁니다.', '주변 공성 병기의 체력이 추가로 늘어납니다.'),
	(3648, '순간이동 장치 (비활성)', NULL, NULL),
	(3649, '공성 시야 와드', '<groupLimit>장신구 소지 개수는 1개로 제한됩니다.</groupLimit><br><br><active>사용 시:</active> <font color=\'#FFFFFF\'>30</font>초 동안 유지되는 <font color=\'#FFFFFF\'>투명 와드</font>를 설치합니다. (재사용 대기시간 30초)', NULL),
	(3671, '마법 부여: 용사', '<stats>공격력 +60<br>재사용 대기시간 +10%</stats>', NULL),
	(3672, '마법 부여: 잿불거인', '<stats>체력 +400<br>추가 체력 +15%</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 전투 중일 때 근처 적에게 초당 7 (챔피언 레벨당 +2)의 마법 피해를 입힙니다. 몬스터에게는 100%의 추가 피해를 입힙니다. ', NULL),
	(3673, '마법 부여: 룬의 메아리', '<stats>주문력 +60<br>이동 속도 +7% </stats><br><br><unique>고유 지속 효과 - 메아리:</unique> 이동하거나 스킬을 사용하면 중첩이 쌓입니다. 중첩이 100회 쌓이면 다음에 스킬로 피해를 입혔을 때 중첩을 모두 소모하여 최대 4명의 대상에게 60 (+ 주문력의 10%)의 추가 마법 피해를 입힙니다.<br><br> 대형 몬스터에게는 250%의 피해를 입히며, 이 효과가 대형 몬스터에게 적중하면 잃은 마나의 18%를 회복합니다.', NULL),
	(3675, '마법 부여: 피갈퀴손', '<stats>공격 속도 +50%</stats><br><br><unique>고유 지속 효과:</unique> 기본 공격 적중 시 대상 최대 체력의 4%만큼 추가 물리 피해를 입힙니다. (몬스터와 미니언 상대로 최대 75)', NULL),
	(3706, '추적자의 검', '<groupLimit>정글 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><stats>몬스터 대상 생명력 흡수 +10%<br><mana>정글에서 기본 마나 재생 +180%</mana></stats><br><br><unique>기본 지속 효과 - 혹한의 강타:</unique> 강타를 적 챔피언에게 사용할 수 있습니다. 대상에게 사용 시 줄어든 고정 피해를 입히며, 대상의 이동 속도를 2초간 20% 훔칩니다.<br><unique>고유 지속 효과 - 이빨과 손톱:</unique> 몬스터에게 기본 공격 시 20의 추가 피해를 입힙니다. 스킬 혹은 공격으로 몬스터에게 피해를 입히면 5초 동안 30의 체력을 훔칩니다. 몬스터 처치 시에는 <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>특별 추가 경험치</a></font>를 얻습니다.', '강타를 챔피언에게 사용하여 둔화시킵니다.'),
	(3711, '추격자의 나이프', '<groupLimit>정글 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><stats>몬스터 상대 생명력 흡수 +10%<br><mana>정글에서 기본 마나 재생 +180%</mana></stats><br><br><unique>고유 지속 효과 - 이빨과 손톱:</unique> 몬스터에게 기본 공격 시 20의 추가 피해를 입힙니다. 스킬 혹은 공격으로 몬스터에게 피해를 입히면 5초 동안 30의 체력을 훔칩니다. 몬스터 처치 시에는 <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>특별 추가 경험치</a></font>를 얻습니다.<br><active>고유 사용 효과 - 와드 설치:</active> 충전량을 1회 소모하여 주변 지역을 150초간 드러내주는 <font color=\'#BBFFFF\'>투명 와드</font>를 설치합니다. 상점 방문 시 2회의 충전량이 다시 채워집니다.<br><br><rules>(플레이어 당 <font color=\'#BBFFFF\'>투명 와드</font>는 한 번에 3개까지만 맵에 설치할 수 있습니다. 동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '계속해서 투명 와드를 얻을 수 있습니다.'),
	(3715, '척후병의 사브르', '<groupLimit>정글 아이템은 1개로 소지가 제한됩니다.</groupLimit><br><br><stats>몬스터 상대 생명력 흡수 +10%<br><mana>정글에서 기본 마나 재생 +180%</mana></stats><br><br><passive>기본 지속 효과 - 승부의 강타:</passive> 강타를 적 챔피언에게 사용하여 4초 동안 표식을 남깁니다. 표식이 있는 대상은 위치가 드러나며, 시전자의 기본 공격에 맞으면 3초에 걸쳐 추가 고정 피해를 입고, 시전자에게 주는 피해량이 20% 감소합니다.<br><unique>고유 지속 효과 - 이빨과 손톱:</unique> 몬스터에게 기본 공격 시 20의 추가 피해를 입힙니다. 스킬 혹은 공격으로 몬스터에게 피해를 입히면 5초 동안 30의 체력을 훔칩니다. 몬스터 처치 시에는 <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>특별 추가 경험치</a></font>를 얻습니다.', '강타로 챔피언에게 표식을 남겨, 이 챔피언에 대한 전투력을 올려줍니다.'),
	(3742, '망자의 갑옷', '<stats>체력 +500<br>방어력 +50</stats><br><br><unique>고유 지속 효과 - 전함:</unique> 이동 시 추진력 중첩이 쌓여, 100 중첩이 되면 이동 속도가 최대 60까지 상승합니다. 추진력은 기절, 도발, 공포, 변이, 이동 불가 효과의 영향을 받으면 빠르게 줄어들며, 둔화된 동안에는 서서히 효력이 줄어듭니다.<br><unique>고유 지속 효과 - 강력한 일격:</unique> 기본 공격 시 추진력이 방출되어 2 중첩 당 1의 물리 피해를 입힙니다. 100 중첩이 방출되면 피해량이 두 배가 되며 대상의 속도가 50% 느려져서 1초에 걸쳐 서서히 회복됩니다. (근접 전용)<br><br><flavorText>\'\'내 갑옷을 뺏을 방도는 하나 뿐이다...\'\' - 무명씨</flavorText>', '이동 시 추진력이 올라 적들을 강하게 타격합니다.'),
	(3748, '거대한 히드라', '<stats>체력 +450<br>공격력 +35<br>기본 체력 재��� +100% </stats><br><br><unique>고유 지속 효과 - 베기:</unique> 기본 공격 적중 시 5 + 자신의 최대 체력의 1%에 해당하는 추가 물리 피해를 대상에게, 40 + 자신의 최대 체력의 2.5%에 해당하는 물리 피해를 원뿔 형태의 지역 안에 있는 다른 적들에게 입힙니다.<br><active>고유 사용 효과 - 초승달:</active> 다음 번 기본 공격은 더 큰 원뿔 형태 지역에 적용되며, 베기의 모든 대상에 대한 피해량이 늘어나 40 + 자신의 최대 체력의 10%에 해당하는 추가 물리 피해를 입힙니다. (재사용 대기시간 20초)<br><br><rules>(동일한 이름의 고유 지속 효과와 중첩되지 않습니다.)</rules>', '본인 체력에 비례하여 광역 피해를 입힙니다.'),
	(3751, '바미의 불씨', '<stats>체력 +280</stats><br><br><unique>고유 지속 효과 - 불사르기:</unique> 근처 적에게 초당 5 (챔피언 레벨당 +1)의 마법 피해를 입힙니다. 미니언과 몬스터에게는 50%의 추가 피해를 입힙니다.', '체력과 불사르기 오오라를 제공합니다.'),
	(3800, '정당한 영광', '<stats>체력 +500<br><mana>마나 +300</mana><br>기본 체력 재생 +100% </stats><br><br><unique>고유 지속 효과 - 영원:</unique> 챔피언으로부터 입은 피해의 15%를 마나로 돌려받습니다. 마나 소모 시 20%를 체력으로 돌려받습니다. (스킬 사용 1회당 최대 25까지)<br><unique>고유 사용 효과:</unique> 적이나 적 포탑 쪽으로 이동할 때는 4초간 이동 속도가 +75% 상승합니다. 3초가 지나면 충격파를 발산하여 2초간 주변 적 챔피언의 이동 속도를 75% 늦춥니다. (재사용 대기시간 90초)<br><br>효과가 활성화된 상태에서 다시 사용하면, 기다릴 필요 없이 충격파를 즉시 발산할 수 있습니다.', '체력과 마나가 증가합니다. 사용하면 적을 향해 갈 때 속도가 상승하며 적을 둔화시킵니다.'),
	(3801, '수정 팔 보호구', '<stats>체력 +200<br>기본 체력 재생 +50% </stats>', '체력과 체력 재생량이 상승합니다.'),
	(3802, '사라진 양피지', '<stats>주문력 +25<br><mana>마나 +300</mana></stats><br><br><unique>고유 지속 효과:</unique> 레벨이 오를 때마다 3초에 걸쳐 최대 마나의 20%를 회복합니다.', '레벨이 오를 때마다 마나를 회복합니다.'),
	(3812, '죽음의 무도', '<stats>공격력 +75<br>재사용 대기시간 감소 +10%</stats><br><br><unique>고유 지속 효과:</unique> 물리 피해를 가하면 가한 피해의 15%만큼 회복합니다. 이 효과는 범위 피해에는 33%만 적용됩니다.<br><unique>고유 지속 효과:</unique> 입은 피해의 15%가 3초 동안 지속되는 출혈 효과로 전환됩니다.', '입은 피해 적용이 잠시 미뤄집니다.'),
	(3901, '가차없는 포격', '바다뱀 은화 500닢이 필요합니다.<br><br><unique>고유 지속 효과:</unique> 이제 포탄 세례가 시간이 갈수록 빠르게 발사됩니다. (지속 시간 동안 추가 6차례 발사)', '포탄 세례의 포격 횟수가 늘어납니다.'),
	(3902, '죽음의 여신', '바다뱀 은화 500닢이 필요합니다.<br><br><unique>고유 지속 효과:</unique> 포탄 세례가 범위 중앙에 추가로 대형 포탄을 하나 발사하여 300%의 고정 피해를 입히고 1.5초간 60% 둔화를 적용합니다. ', '포탄 세례로 대형 포탄을 발사합니다.'),
	(3903, '사기진작', '바다뱀 은화 500닢이 필요합니다.<br><br><unique>고유 지속 효과:</unique> 포탄 세례 범위 안의 아군은 이제 2초간 이동 속도가 30% 상승합니다.', '포탄 세례로 아군의 속도를 상승시킵니다.');
